    'Plants and parts of plants (including seeds and fruits), of a kind used primarily in perfumery, in pharmacy or for insecticidal, fungicidal or similar purposes, fresh, chilled, frozen or dried, whether or not cut, crushed or powdered' => 'Rośliny i części roślin (włącznie z nasionami i owocami), w rodzaju stosowanych głównie w perfumerii, farmacji lub do celów owadobójczych, grzybobójczych lub podobnych, świeże, schłodzone, zamrożone lub suszone, nawet krojone, kruszone lub proszkowane',
