    'Swedes, mangolds, fodder roots, hay, lucerne (alfalfa), clover, sainfoin, forage kale, lupines, vetches and similar forage products, whether or not in the form of pellets' => 'Brukiew, buraki pastewne, korzenie pastewne, siano, lucerna (alfalfa), koniczyna, esparceta, kapusta pastewna, łubin, wyka i podobne produkty pastewne, nawet granulowane',
    'Lac; natural gums, resins, gum-resins and oleoresins (for example, balsams)' => 'Szelak; gumy naturalne, żywice, gumożywice i oleożywice (na przykład balsamy)',
