    'Vegetable materials of a kind used primarily for plaiting (for example, bamboos, rattans, reeds, rushes, osier, raffia, cleaned, bleached or dyed cereal straw, and lime bark)' => 'Materiały roślinne, w rodzaju stosowanych głównie do wyplatania (na przykład bambus, trzcinopalmy rotang (rattan), trzciny, sitowie, łoziny, rafia, słoma zbożowa czyszczona, bielona lub barwiona i łyko lipowe)',
    'Vegetable products not elsewhere specified or included' => 'Produkty pochodzenia roślinnego, gdzie indziej niewymienione ani niewłączone',
    'Pig fat (including lard) and poultry fat, other than that of heading 0209 or 1503' => 'Tłuszcz ze świń (włącznie ze smalcem) i tłuszcz z drobiu, inne niż te objęte pozycją 0209 lub 1503',
