    'Fats and oils and their fractions, of fish or marine mammals, whether or not refined, but not chemically modified' => 'Tłuszcze i oleje i ich frakcje, z ryb lub ze ssaków morskich, nawet rafinowane, ale niemodyfikowane chemicznie',
