    'Coconut (copra), palm kernel or babassu oil and fractions thereof, whether or not refined, but not chemically modified' => 'Olej kokosowy (z kopry), olej z ziaren palmowych lub olej babassu i ich frakcje, nawet rafinowane, ale niemodyfikowane chemicznie',
