    'Other fixed vegetable or microbial fats and oils (including jojoba oil) and their fractions, whether or not refined, but not chemically modified' => 'Pozostałe ciekłe tłuszcze i oleje roślinne lub mikrobiologiczne (włącznie z olejem jojoba) i ich frakcje, nawet rafinowane, ale niemodyfikowane chemicznie',
