    'Margarine; edible mixtures or preparations of animal, vegetable or microbial fats or oils or of fractions of different fats or oils of this chapter, other than edible fats or oils or their fractions of heading 1516' => 'Margaryna; jadalne mieszaniny lub produkty z tłuszczów lub olejów, zwierzęcych, roślinnych lub mikrobiologicznych, lub z frakcji różnych tłuszczów lub olejów, z niniejszego działu, inne niż jadalne tłuszcze i oleje lub ich frakcje, objęte pozycją 1516',
    'Animal, vegetable or microbial fats and oils and their fractions, boiled, oxidised, dehydrated, sulphurised, blown, polymerised by heat in vacuum or in inert gas or otherwise chemically modified, excluding those of heading 1516; inedible mixtures or preparations of animal, vegetable or microbial fats or oils or of fractions of different fats or oils of this chapter, not elsewhere specified or included' => 'Tłuszcze i oleje, zwierzęce, roślinne lub mikrobiologiczne i ich frakcje, gotowane, utlenione, odwodnione, siarkowane, napowietrzane, polimeryzowane przez ogrzewanie w próżni lub w gazie obojętnym, lub inaczej modyfikowane chemicznie, z wyłączeniem objętych pozycją 1516; niejadalne mieszaniny lub preparaty z tłuszczów lub olejów, zwierzęcych, roślinnych lub mikrobiologicznych, lub z frakcji różnych tłuszczów lub olejów z niniejszego działu, gdzie indziej niewymienione ani niewłączone',
    'Vegetable waxes (other than triglycerides), beeswax, other insect waxes and spermaceti, whether or not refined or coloured' => 'Woski roślinne (inne niż triglicerydy), wosk pszczeli, pozostałe woski owadzie i spermacet, nawet rafinowane lub barwione',
    'Degras; residues resulting from the treatment of fatty substances or animal or vegetable waxes' => 'Degras; pozostałości powstałe przy obróbce substancji tłuszczowych oraz wosków zwierzęcych lub roślinnych',
    'Sausages and similar products, of meat, meat offal, blood or insects; food preparations based on these products' => 'Kiełbasy i podobne wyroby z mięsa, podrobów, krwi lub owadów; przetwory spożywcze na bazie tych wyrobów',
    'Other prepared or preserved meat, meat offal, blood or insects' => 'Pozostałe mięso, podroby, krew lub owady, przetworzone lub zakonserwowane',
    'Extracts and juices of meat, fish or crustaceans, molluscs or other aquatic invertebrates' => 'Ekstrakty i soki, z mięsa, ryb lub skorupiaków, mięczaków lub pozostałych bezkręgowców wodnych',
