    'Fruit, nuts and other edible parts of plants, otherwise prepared or preserved, whether or not containing added sugar or other sweetening matter or spirit, not elsewhere specified or included' => 'Owoce, orzechy i pozostałe jadalne części roślin, inaczej przetworzone lub zakonserwowane, nawet zawierające dodatek cukru lub innej substancji słodzącej, lub alkoholu, gdzie indziej niewymienione ani niewłączone',
    'Fruit or nut juices (including grape must and coconut water) and vegetable juices, unfermented and not containing added spirit, whether or not containing added sugar or other sweetening matter' => 'Soki owocowe lub z orzechów (włączając moszcz gronowy i wodę kokosową) i soki warzywne, niesfermentowane i niezawierające dodatku alkoholu, nawet z dodatkiem cukru lub innej substancji słodzącej',
