    'Sauces and preparations therefor; mixed condiments and mixed seasonings; mustard flour and meal and prepared mustard' => 'Sosy i preparaty do nich; zmieszane przyprawy i zmieszane przyprawy korzenne; mąka i mączka, z gorczycy oraz gotowa musztarda',
