    'Waters, including natural or artificial mineral waters and aerated waters, not containing added sugar or other sweetening matter nor flavoured; ice and snow' => 'Wody, włącznie z naturalnymi lub sztucznymi wodami mineralnymi i wodami gazowanymi, niezawierające dodatku cukru lub innego środka słodzącego ani aromatyzującego; lód i śnieg',
