    'Undenatured ethyl alcohol of an alcoholic strength by volume of less than 80 % vol; spirits, liqueurs and other spirituous beverages' => 'Alkohol etylowy nieskażony o objętościowej mocy alkoholu mniejszej niż 80 % obj.; wódki, likiery i pozostałe napoje spirytusowe',
    'Vinegar and substitutes for vinegar obtained from acetic acid' => 'Ocet i namiastki octu otrzymane z kwasu octowego',
    'Flours, meals and pellets, of meat or meat offal, of fish or of crustaceans, molluscs or other aquatic invertebrates, unfit for human consumption; greaves' => 'Mąki, mączki i granulki, z mięsa lub podrobów, ryb lub skorupiaków, mięczaków lub pozostałych bezkręgowców wodnych, nienadające się do spożycia przez ludzi; skwarki',
    'Bran, sharps and other residues, whether or not in the form of pellets, derived from the sifting, milling or other working of cereals or of leguminous plants' => 'Otręby, śruta i inne pozostałości odsiewu, przemiału lub innej obróbki zbóż i roślin strączkowych, nawet granulowane',
    'Residues of starch manufacture and similar residues, beet-pulp, bagasse and other waste of sugar manufacture, brewing or distilling dregs and waste, whether or not in the form of pellets' => 'Pozostałości z produkcji skrobi i podobne pozostałości, wysłodki buraczane, wytłoczyny z trzciny cukrowej i pozostałe odpady z produkcji cukru, pozostałości i odpady browarnicze i gorzelniane, nawet w postaci granulek',
