    'Cigars, cheroots, cigarillos and cigarettes, of tobacco or of tobacco substitutes' => 'Cygara, nawet z obciętymi końcami, cygaretki i papierosy, z tytoniu lub namiastek tytoniu',
    'Other manufactured tobacco and manufactured tobacco substitutes; homogenised or reconstituted tobacco; tobacco extracts and essences' => 'Pozostały przetworzony tytoń i przetworzone namiastki tytoniu; tytoń homogenizowany lub odtworzony; ekstrakty i esencje, z tytoniu',
