    'Salt (including table salt and denatured salt) and pure sodium chloride, whether or not in aqueous solution or containing added anti-caking or free-flowing agents; sea water' => 'Sól (włączając sól kuchenną i sól denaturowaną) i czysty chlorek sodu, nawet w roztworze wodnym lub zawierająca dodatek środków zapobiegających zbrylaniu lub środków zapewniających dobrą sypkość; woda morska',
