    'Hormones, prostaglandins, thromboxanes and leukotrienes, natural or reproduced by synthesis; derivatives and structural analogues thereof, including chain modified polypeptides, used primarily as hormones' => 'Hormony, prostaglandyny, tromboksany i leukotrieny, naturalne lub syntetyczne; ich pochodne i analogi strukturalne, włącznie z polipeptydami o zmodyfikowanym łańcuchu, stosowane głównie jako hormony',
    'Glycosides, natural or reproduced by synthesis, and their salts, ethers, esters and other derivatives' => 'Glikozydy, naturalne lub syntetyczne oraz ich sole, etery, estry i pozostałe pochodne',
    'Alkaloids, natural or reproduced by synthesis, and their salts, ethers, esters and other derivatives' => 'Alkaloidy, naturalne lub syntetyczne, ich sole, etery, estry i pozostałe pochodne',
    'Antibiotics' => 'Antybiotyki',
    'Glands and other organs for organo-therapeutic uses, dried, whether or not powdered; extracts of glands or other organs or of their secretions for organo-therapeutic uses; heparin and its salts; other human or animal substances prepared for therapeutic or prophylactic uses, not elsewhere specified or included' => 'Gruczoły i pozostałe narządy do celów organoterapeutycznych, suszone, nawet sproszkowane; ekstrakty z gruczołów lub pozostałych narządów lub ich wydzielin do celów organoterapeutycznych; heparyna i jej sole; pozostałe substancje ludzkie lub zwierzęce, preparowane do celów terapeutycznych lub profilaktycznych, gdzie indziej niewymienione ani niewłączone',
    'Human blood; animal blood prepared for therapeutic, prophylactic or diagnostic uses; antisera, other blood fractions and immunological products, whether or not modified or obtained by means of biotechnological processes; vaccines, toxins, cultures of micro-organisms (excluding yeasts) and similar products; cell cultures, whether or not modified' => 'Krew ludzka; krew zwierzęca preparowana do celów terapeutycznych, profilaktycznych lub diagnostycznych; antysurowice, pozostałe frakcje krwi i produkty immunologiczne, nawet modyfikowane lub otrzymywane w procesach biotechnologicznych; szczepionki, toksyny, hodowle mikroorganizmów (z wyłączeniem drożdży) oraz podobne produkty; kultury komórkowe, nawet modyfikowane',
    'Medicaments (excluding goods of heading 3002, 3005 or 3006) consisting of two or more constituents which have been mixed together for therapeutic or prophylactic uses, not put up in measured doses or in forms or packings for retail sale' => 'Leki (z wyłączeniem produktów objętych pozycją 3002, 3005 lub 3006) złożone z dwóch lub więcej składników, które zostały zmieszane razem do użytku terapeutycznego lub profilaktycznego, niepakowane do sprzedaży detalicznej w odmierzone dawki lub w postacie, lub w opakowania',
    'Medicaments (excluding goods of heading 3002, 3005 or 3006) consisting of mixed or unmixed products for therapeutic or prophylactic uses, put up in measured doses (including those in the form of transdermal administration systems) or in forms or packings for retail sale' => 'Leki (z wyłączeniem produktów objętych pozycją 3002, 3005 lub 3006) złożone z produktów zmieszanych lub niezmieszanych do celów terapeutycznych lub profilaktycznych, pakowane w odmierzone dawki (włącznie z lekami podawanymi przez skórę) lub do postaci, lub w opakowania do sprzedaży detalicznej',
    'Wadding, gauze, bandages and similar articles (for example, dressings, adhesive plasters, poultices), impregnated or coated with pharmaceutical substances or put up in forms or packings for retail sale for medical, surgical, dental or veterinary purposes' => 'Wata, gaza, bandaże i podobne artykuły (na przykład opatrunki, plastry przylepne, kataplazmy) impregnowane lub pokryte substancjami farmaceutycznymi lub pakowane do postaci, lub w opakowania do sprzedaży detalicznej, do celów medycznych, chirurgicznych, dentystycznych lub weterynaryjnych',
    'Pharmaceutical goods specified in note 4 to this chapter' => 'Produkty farmaceutyczne wymienione w uwadze 4 do niniejszego działu',
    'Mineral or chemical fertilisers, nitrogenous' => 'Nawozy mineralne lub chemiczne, azotowe',
