    'Mineral or chemical fertilisers, potassic' => 'Nawozy potasowe, mineralne lub chemiczne',
    'Mineral or chemical fertilisers containing two or three of the fertilising elements nitrogen, phosphorus and potassium; other fertilisers; goods of this chapter in tablets or similar forms or in packages of a gross weight not exceeding 10 kg' => 'Nawozy mineralne lub chemiczne, zawierające dwa lub trzy z pierwiastków nawozowych: azot, fosfor i potas; pozostałe nawozy; towary niniejszego działu w tabletkach lub podobnych postaciach, lub w opakowaniach o masie brutto nieprzekraczającej 10 kg',
    'Tanning extracts of vegetable origin; tannins and their salts, ethers, esters and other derivatives' => 'Ekstrakty garbników pochodzenia roślinnego; garbniki i ich sole, etery, estry i pozostałe pochodne',
    'Synthetic organic tanning substances; inorganic tanning substances; tanning preparations, whether or not containing natural tanning substances; enzymatic preparations for pre-tanning' => 'Syntetyczne, organiczne substancje garbujące; nieorganiczne substancje garbujące; preparaty garbujące, nawet zawierające naturalne substancje garbujące; preparaty enzymatyczne do garbowania wstępnego',
    'Colouring matter of vegetable or animal origin (including dyeing extracts but excluding animal black), whether or not chemically defined; preparations as specified in note 3 to this chapter based on colouring matter of vegetable or animal origin' => 'Środki barwiące pochodzenia roślinnego lub zwierzęcego (włącznie z ekstraktami barwiącymi, ale z wyłączeniem czerni kostnej), nawet zdefiniowane chemicznie; preparaty wymienione w uwadze 3 do niniejszego działu, na bazie środków barwiących pochodzenia roślinnego lub zwierzęcego',
