    'Prepared pigments, prepared opacifiers and prepared colours, vitrifiable enamels and glazes, engobes (slips), liquid lustres and similar preparations, of a kind used in the ceramic, enamelling or glass industry; glass frit and other glass, in the form of powder, granules or flakes' => 'Pigmenty, środki matujące i farby, gotowe, szkliste emalie i glazury, pobiałki (masy lejne), ciekłe materiały do wytwarzania połysku i podobne preparaty, w rodzaju stosowanych w przemyśle ceramicznym, emalierskim i szklarskim; fryta szklana i pozostałe szkło w postaci proszku, granulek lub płatków',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in a non-aqueous medium; solutions as defined in note 4 to this chapter' => 'Farby i pokosty (włącznie z emaliami i lakierami) na bazie polimerów syntetycznych i chemicznie modyfikowanych polimerów naturalnych, rozproszonych lub rozpuszczonych w środowisku niewodnym; roztwory określone w uwadze 4 do niniejszego działu',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in an aqueous medium' => 'Farby i pokosty (włącznie z emaliami i lakierami) na bazie polimerów syntetycznych lub polimerów naturalnych modyfikowanych chemicznie, rozproszone lub rozpuszczone w środowisku wodnym',
    'Other paints and varnishes (including enamels, lacquers and distempers); prepared water pigments of a kind used for finishing leather' => 'Pozostałe farby i pokosty (włącznie z emaliami, lakierami i farbami klejowymi); gotowe pigmenty wodne, w rodzaju stosowanych do wykańczania skóry',
    'Pigments (including metallic powders and flakes) dispersed in non-aqueous media, in liquid or paste form, of a kind used in the manufacture of paints (including enamels); stamping foils; dyes and other colouring matter put up in forms or packings for retail sale' => 'Pigmenty (włącznie z proszkami i płatkami metali) rozproszone w środowisku niewodnym, w postaci cieczy lub pasty, w rodzaju stosowanych do produkcji farb (włącznie z emaliami); folie do wytłoczeń; barwniki i pozostałe środki barwiące pakowane do postaci lub w opakowania do sprzedaży detalicznej',
