    'Glaziers\' putty, grafting putty, resin cements, caulking compounds and other mastics; painters\' fillings; non-refractory surfacing preparations for façades, indoor walls, floors, ceilings or the like' => 'Kit szklarski, kit ogrodniczy, kity żywiczne, masy uszczelniające i pozostałe mastyksy; wypełniacze malarskie, nieogniotrwałe preparaty powierzchniowe do fasad, ścian wewnętrznych, podłóg, sufitów lub tym podobne',
    'Printing ink, writing or drawing ink and other inks, whether or not concentrated or solid' => 'Farba drukarska, atrament do pisania, tusz kreślarski i pozostałe atramenty, nawet stężone lub stałe',
    'Essential oils (terpeneless or not), including concretes and absolutes; resinoids; extracted oleoresins; concentrates of essential oils in fats, in fixed oils, in waxes or the like, obtained by enfleurage or maceration; terpenic by-products of the deterpenation of essential oils; aqueous distillates and aqueous solutions of essential oils' => 'Olejki eteryczne (nawet pozbawione terpenów), włącznie z konkretami i absolutami; rezinoidy; wyekstrahowane oleożywice; koncentraty olejków eterycznych w tłuszczach, ciekłych olejach, woskach lub tym podobnych, otrzymanych w procesie maceracji tłuszczami (enfleurage) lub maceracji; terpenowe produkty uboczne deterpenacji olejków eterycznych; wodne destylaty i wodne roztwory olejków eterycznych',
    'Mixtures of odoriferous substances and mixtures (including alcoholic solutions) with a basis of one or more of these substances, of a kind used as raw materials in industry; other preparations based on odoriferous substances, of a kind used for the manufacture of beverages' => 'Mieszaniny substancji zapachowych i mieszaniny (włącznie z roztworami alkoholowymi) na bazie jednej lub na wielu takich substancjach, w rodzaju stosowanych jako surowce w przemyśle; pozostałe preparaty oparte na substancjach zapachowych, w rodzaju stosowanych do produkcji napojów',
    'Perfumes and toilet waters' => 'Perfumy i wody toaletowe',
    'Beauty or make-up preparations and preparations for the care of the skin (other than medicaments), including sunscreen or suntan preparations; manicure or pedicure preparations' => 'Preparaty kosmetyczne lub upiększające oraz preparaty do pielęgnacji skóry (inne niż leki), włącznie z preparatami przeciwsłonecznymi lub do opalania; preparaty do manicure lub pedicure',
    'Preparations for use on the hair' => 'Preparaty do włosów',
    'Preparations for oral or dental hygiene, including denture fixative pastes and powders; yarn used to clean between the teeth (dental floss), in individual retail packages' => 'Preparaty do higieny zębów lub jamy ustnej, włącznie z pastami i proszkami do przytwierdzania protez; nici dentystyczne do czyszczenia międzyzębowego (dental floss), w jednostkowych opakowaniach do sprzedaży detalicznej',
    'Pre-shave, shaving or aftershave preparations, personal deodorants, bath preparations, depilatories and other perfumery, cosmetic or toilet preparations, not elsewhere specified or included; prepared room deodorisers, whether or not perfumed or having disinfectant properties' => 'Preparaty stosowane przed goleniem, do golenia lub po goleniu, dezodoranty osobiste, preparaty do kąpieli, depilatory i pozostałe preparaty perfumeryjne, kosmetyczne lub toaletowe, gdzie indziej niewymienione ani niewłączone; gotowe odświeżacze pomieszczeń, nawet perfumowane, lub mające własności dezynfekcyjne',
