    'Lubricating preparations (including cutting-oil preparations, bolt or nut release preparations, anti-rust or anti-corrosion preparations and mould-release preparations, based on lubricants) and preparations of a kind used for the oil or grease treatment of textile materials, leather, furskins or other materials, but excluding preparations containing, as basic constituents, 70 % or more by weight of petroleum oils or of oils obtained from bituminous minerals' => 'Preparaty smarowe (włącznie z cieczami chłodząco-smarującymi, preparatami do rozluźniania śrub i nakrętek, preparatami przeciwrdzewnymi i antykorozyjnymi, preparatami zapobiegającymi przyleganiu do formy opartymi na smarach) oraz preparaty w rodzaju stosowanych do natłuszczania materiałów włókienniczych, skóry wyprawionej, skór futerkowych lub pozostałych materiałów, z wyłączeniem preparatów zawierających, jako składnik zasadniczy, 70 % masy lub więcej olejów ropy naftowej lub olejów otrzymanych z minerałów bitumicznych',
    'Artificial waxes and prepared waxes' => 'Woski sztuczne i woski preparowane',
