    'Gelatin (including gelatin in rectangular (including square) sheets, whether or not surface-worked or coloured) and gelatin derivatives; isinglass; other glues of animal origin, excluding casein glues of heading 3501' => 'Żelatyna (włącznie z żelatyną w arkuszach prostokątnych (włączając kwadratowe), nawet powierzchniowo obrobionych lub barwionych) oraz pochodne żelatyny; karuk; pozostałe kleje pochodzenia zwierzęcego, z wyłączeniem klejów kazeinowych objętych pozycją 3501',
    'Peptones and their derivatives; other protein substances and their derivatives, not elsewhere specified or included; hide powder, whether or not chromed' => 'Peptony i ich pochodne; pozostałe substancje białkowe oraz ich pochodne, gdzie indziej niewymienione ani niewłączone; proszek skórzany, nawet chromowany',
