    'Enzymes; prepared enzymes not elsewhere specified or included' => 'Enzymy; preparaty enzymatyczne, gdzie indziej niewymienione ani niewłączone',
    'Safety fuses; detonating cords; percussion or detonating caps; igniters; electric detonators' => 'Lonty prochowe; lonty detonujące; spłonki nabojowe lub detonujące; zapalniki, detonatory elektryczne',
    'Fireworks, signalling flares, rain rockets, fog signals and other pyrotechnic articles' => 'Ognie sztuczne, petardy sygnalizacyjne, rakiety do sygnalizacji podczas mgły lub deszczu oraz pozostałe artykuły pirotechniczne',
    'Ferro-cerium and other pyrophoric alloys in all forms; articles of combustible materials as specified in note 2 to this chapter' => 'Stopy żelazocer i pozostałe stopy piroforyczne, we wszystkich postaciach; artykuły z materiałów łatwo palnych wymienione w uwadze 2 do niniejszego działu',
    'Photographic plates and film in the flat, sensitised, unexposed, of any material other than paper, paperboard or textiles; instant print film in the flat, sensitised, unexposed, whether or not in packs' => 'Film i płyty fotograficzne płaskie, światłoczułe, nienaświetlone, z dowolnego materiału innego niż papier, tektura lub tekstylia; film płaski do natychmiastowych odbitek, światłoczuły, nienaświetlony, nawet w kasetach',
