    'Insecticides, rodenticides, fungicides, herbicides, anti-sprouting products and plant-growth regulators, disinfectants and similar products, put up in forms or packings for retail sale or as preparations or articles (for example, sulphur-treated bands, wicks and candles, and fly-papers)' => 'Środki owadobójcze, gryzoniobójcze, grzybobójcze, chwastobójcze, opóźniające kiełkowanie, regulatory wzrostu roślin, środki odkażające i podobne produkty, pakowane do postaci lub w opakowania do sprzedaży detalicznej, lub w postaci preparatów lub artykułów (na przykład taśm nasyconych siarką, knotów i świec oraz lepów na muchy)',
    'Finishing agents, dye carriers to accelerate the dyeing or fixing of dyestuffs and other products and preparations (for example, dressings and mordants), of a kind used in the textile, paper, leather or like industries, not elsewhere specified or included' => 'Środki wykańczalnicze, nośniki barwników przyśpieszające barwienie, utrwalacze barwników i pozostałe preparaty (na przykład klejonki i zaprawy), w rodzaju stosowanych w przemysłach włókienniczym, papierniczym, skórzanym i podobnych, gdzie indziej niewymienione ani niewłączone',
    'Pickling preparations for metal surfaces; fluxes and other auxiliary preparations for soldering, brazing or welding; soldering, brazing or welding powders and pastes consisting of metal and other materials; preparations of a kind used as cores or coatings for welding electrodes or rods' => 'Preparaty do wytrawiania powierzchni metali; topniki i pozostałe preparaty pomocnicze do lutowania, lutowania twardego lub spawania; proszki i pasty do lutowania, lutowania twardego lub spawania, złożone z metalu i innych materiałów; preparaty, w rodzaju stosowanych jako rdzenie lub otuliny elektrod lub prętów spawalniczych',
    'Anti-knock preparations, oxidation inhibitors, gum inhibitors, viscosity improvers, anti-corrosive preparations and other prepared additives, for mineral oils (including gasoline) or for other liquids used for the same purposes as mineral oils' => 'Środki przeciwstukowe, inhibitory utleniania, inhibitory tworzenia się żywic, dodatki zwiększające lepkość, preparaty antykorozyjne oraz pozostałe preparaty dodawane do olejów mineralnych (włącznie z benzyną) lub do innych cieczy, stosowanych do tych samych celów, co oleje mineralne',
    'Prepared rubber accelerators; compound plasticisers for rubber or plastics, not elsewhere specified or included; anti-oxidising preparations and other compound stabilisers for rubber or plastics' => 'Gotowe przyspieszacze wulkanizacji; złożone plastyfikatory do gumy (kauczuku) lub tworzyw sztucznych, gdzie indziej niewymienione ani niewłączone; preparaty przeciwutleniające oraz pozostałe związki stabilizujące do gumy lub tworzyw sztucznych',
    'Organic composite solvents and thinners, not elsewhere specified or included; prepared paint or varnish removers' => 'Organiczne złożone rozpuszczalniki i rozcieńczalniki, gdzie indziej niewymienione ani niewłączone; gotowe zmywacze farb i lakierów',
    'Reaction initiators, reaction accelerators and catalytic preparations, not elsewhere specified or included' => 'Inicjatory reakcji, przyspieszacze reakcji oraz preparaty katalityczne, gdzie indziej niewymienione ani niewłączone',
    'Refractory cements, mortars, concretes and similar compositions, including dolomite ramming mix, other than products of heading 3801' => 'Cementy, zaprawy, masy betonowe i podobne wyroby, ogniotrwałe, w tym dolomitowa masa ogniotrwała do ubijania, inne niż wyroby objęte pozycją 3801',
    'Mixed alkylbenzenes and mixed alkylnaphthalenes, other than those of heading 2707 or 2902' => 'Mieszane alkilobenzeny i mieszane alkilonaftaleny, inne niż te objęte pozycją 2707 lub 2902',
    'Chemical elements doped for use in electronics, in the form of discs, wafers or similar forms; chemical compounds doped for use in electronics' => 'Pierwiastki chemiczne domieszkowane do stosowania w elektronice, w postaci krążków, płytek lub podobnych postaciach; związki chemiczne domieszkowane, do stosowania w elektronice',
    'Diagnostic or laboratory reagents on a backing, prepared diagnostic or laboratory reagents whether or not on a backing, whether or not put up in the form of kits, other than those of heading 3006; certified reference materials' => 'Odczynniki diagnostyczne lub laboratoryjne na podłożach, gotowe odczynniki diagnostyczne lub laboratoryjne, nawet na podłożach, nawet w postaci zestawów, inne niż te objęte pozycją 3006; certyfikowane materiały wzorcowe',
    'Industrial monocarboxylic fatty acids; acid oils from refining; industrial fatty alcohols' => 'Przemysłowe monokarboksylowe kwasy tłuszczowe; kwaśne oleje z rafinacji; przemysłowe alkohole tłuszczowe',
    'Prepared binders for foundry moulds or cores; chemical products and preparations of the chemical or allied industries (including those consisting of mixtures of natural products), not elsewhere specified or included' => 'Gotowe spoiwa do form odlewniczych lub rdzeni; produkty chemiczne i preparaty przemysłu chemicznego lub przemysłów pokrewnych (włączając te składające się z mieszanin produktów naturalnych), gdzie indziej niewymienione ani niewłączone',
    'Residual products of the chemical or allied industries, not elsewhere specified or included; municipal waste; sewage sludge; other wastes specified in note 6 to this chapter' => 'Produkty odpadowe przemysłu chemicznego lub przemysłów pokrewnych, gdzie indziej niewymienione ani niewłączone; odpady komunalne; osady ze ścieków kanalizacyjnych; pozostałe odpady wymienione w uwadze 6 do niniejszego działu',
    'Biodiesel and mixtures thereof, not containing or containing less than 70 % by weight of petroleum oils or oils obtained from bituminous minerals' => 'Biodiesel i jego mieszaniny, niezawierające lub zawierające mniej niż 70 % masy olejów ropy naftowej lub olejów otrzymywanych z minerałów bitumicznych',
    'Mixtures containing halogenated derivatives of methane, ethane or propane, not elsewhere specified or included' => 'Mieszaniny zawierające fluorowcowane pochodne metanu, etanu lub propanu, gdzie indziej niewymienione ani niewłączone',
    'Polymers of ethylene, in primary forms' => 'Polimery etylenu, w formach podstawowych',
    'Polymers of propylene or of other olefins, in primary forms' => 'Polimery propylenu lub innych alkenów, w formach podstawowych',
    'Polymers of styrene, in primary forms' => 'Polimery styrenu, w formach podstawowych',
    'Polymers of vinyl chloride or of other halogenated olefins, in primary forms' => 'Polimery chlorku winylu lub innych fluorowcowanych alkenów, w formach podstawowych',
    'Polymers of vinyl acetate or of other vinyl esters, in primary forms; other vinyl polymers in primary forms' => 'Polimery octanu winylu lub innych estrów winylowych, w formach podstawowych; inne polimery winylowe w formach podstawowych',
    'Acrylic polymers in primary forms' => 'Polimery akrylowe w formach podstawowych',
    'Polyacetals, other polyethers and epoxide resins, in primary forms; polycarbonates, alkyd resins, polyallyl esters and other polyesters, in primary forms' => 'Poliacetale, pozostałe polietery i żywice epoksydowe, w formach podstawowych; poliwęglany, żywice alkidowe, poliestry allilowe i pozostałe poliestry, w formach podstawowych',
    'Polyamides in primary forms' => 'Poliamidy w formach podstawowych',
    'Amino-resins, phenolic resins and polyurethanes, in primary forms' => 'Żywice aminowe, żywice fenolowe i poliuretany, w formach podstawowych',
    'Petroleum resins, coumarone-indene resins, polyterpenes, polysulphides, polysulphones and other products specified in note 3 to this chapter, not elsewhere specified or included, in primary forms' => 'Żywice naftowe, żywice kumaronowo-indenowe, politerpeny, polisiarczki, polisulfony i pozostałe produkty wymienione w uwadze 3 do niniejszego działu, gdzie indziej niewymienione ani niewłączone, w formach podstawowych',
    'Cellulose and its chemical derivatives, not elsewhere specified or included, in primary forms' => 'Celuloza i jej pochodne chemiczne, gdzie indziej niewymienione ani niewłączone, w formach podstawowych',
    'Natural polymers (for example, alginic acid) and modified natural polymers (for example, hardened proteins, chemical derivatives of natural rubber), not elsewhere specified or included, in primary forms' => 'Polimery naturalne (na przykład kwas alginowy) i modyfikowane polimery naturalne (na przykład utwardzone białka, pochodne chemiczne kauczuku naturalnego), gdzie indziej niewymienione ani niewłączone, w formach podstawowych',
    'Waste, parings and scrap, of plastics' => 'Odpady, ścinki i braki, z tworzyw sztucznych',
    'Monofilament of which any cross-sectional dimension exceeds 1 mm, rods, sticks and profile shapes, whether or not surface-worked but not otherwise worked, of plastics' => 'Przędza jednowłóknowa (monofilament), której dowolny wymiar przekroju poprzecznego przekracza 1 mm, pręty, pałeczki i kształtowniki profilowane, nawet obrobione powierzchniowo, ale nieobrobione inaczej, z tworzyw sztucznych',
    'Tubes, pipes and hoses, and fittings therefor (for example, joints, elbows, flanges), of plastics' => 'Rury, rurki i węże oraz ich osprzęt (na przykład złącza, kolanka, kołnierze), z tworzyw sztucznych',
    'Floor coverings of plastics, whether or not self-adhesive, in rolls or in the form of tiles; wall or ceiling coverings of plastics, as defined in note 9 to this chapter' => 'Pokrycia podłogowe z tworzyw sztucznych, nawet samoprzylepne, w rolkach lub w postaci płytek; pokrycia ścienne lub sufitowe, z tworzyw sztucznych, jak określono w uwadze 9 do niniejszego działu',
    'Self-adhesive plates, sheets, film, foil, tape, strip and other flat shapes, of plastics, whether or not in rolls' => 'Samoprzylepne płyty, arkusze, folie, taśmy, pasy i inne płaskie kształty, z tworzyw sztucznych, nawet w rolkach',
    'Other plates, sheets, film, foil and strip, of plastics, non-cellular and not reinforced, laminated, supported or similarly combined with other materials' => 'Pozostałe płyty, arkusze, folie, taśmy i pasy, z tworzyw sztucznych niekomórkowych, niewzmocnionych, nielaminowanych, nieosadzonych na podłożu ani niepołączonych w podobny sposób z innymi materiałami',
    'Other plates, sheets, film, foil and strip, of plastics' => 'Pozostałe płyty, arkusze, folie, taśmy i pasy, z tworzyw sztucznych',
    'Baths, shower-baths, sinks, washbasins, bidets, lavatory pans, seats and covers, flushing cisterns and similar sanitary ware, of plastics' => 'Wanny, brodziki, zlewy, umywalki, bidety, miski klozetowe, sedesy i pokrywy, spłuczki ustępowe i podobne artykuły sanitarne, z tworzyw sztucznych',
    'Articles for the conveyance or packing of goods, of plastics; stoppers, lids, caps and other closures, of plastics' => 'Artykuły do transportu lub pakowania towarów, z tworzyw sztucznych; korki, pokrywki, kapsle i pozostałe zamknięcia, z tworzyw sztucznych',
    'Tableware, kitchenware, other household articles and hygienic or toilet articles, of plastics' => 'Naczynia stołowe, naczynia kuchenne, pozostałe artykuły gospodarstwa domowego i artykuły higieniczne lub toaletowe, z tworzyw sztucznych',
    'Builders\' ware of plastics, not elsewhere specified or included' => 'Artykuły budowlane z tworzyw sztucznych, gdzie indziej niewymienione ani niewłączone',
    'Other articles of plastics and articles of other materials of headings 3901 to 3914' => 'Pozostałe artykuły z tworzyw sztucznych oraz artykuły z pozostałych materiałów objętych pozycjami od 3901 do 3914',
    'Natural rubber, balata, gutta-percha, guayule, chicle and similar natural gums, in primary forms or in plates, sheets or strip' => 'Kauczuk naturalny, balata, gutaperka, guayule, chicle i podobne żywice naturalne, w formach podstawowych lub w płytach, arkuszach lub taśmach',
    'Synthetic rubber and factice derived from oils, in primary forms or in plates, sheets or strip; mixtures of any product of heading 4001 with any product of this heading, in primary forms or in plates, sheets or strip' => 'Kauczuk syntetyczny i faktysa pochodząca z olejów, w formach podstawowych lub w płytach, arkuszach lub taśmach; mieszaniny dowolnego produktu objętego pozycją 4001 z dowolnym produktem objętym niniejszą pozycją, w formach podstawowych lub w płytach, arkuszach lub taśmach',
    'Compounded rubber, unvulcanised, in primary forms or in plates, sheets or strip' => 'Mieszanki kauczukowe (gumowe), niewulkanizowane, w formach podstawowych lub w płytach, arkuszach lub taśmach',
    'Other forms (for example, rods, tubes and profile shapes) and articles (for example, discs and rings), of unvulcanised rubber' => 'Pozostałe formy (na przykład pręty, rury i kształtowniki) oraz artykuły (na przykład krążki i pierścienie) z kauczuku niewulkanizowanego',
    'Plates, sheets, strip, rods and profile shapes, of vulcanised rubber other than hard rubber' => 'Płyty, arkusze, taśmy, pręty i kształtowniki, z gumy innej niż ebonit',
    'Tubes, pipes and hoses, of vulcanised rubber other than hard rubber, with or without their fittings (for example, joints, elbows, flanges)' => 'Przewody, rury i węże z gumy innej niż ebonit, z wyposażeniem lub bez (na przykład złącza, kolanka, kołnierze)',
    'Conveyor or transmission belts or belting, of vulcanised rubber' => 'Pasy lub taśmy, przenośnikowe lub napędowe, z gumy',
    'New pneumatic tyres, of rubber' => 'Opony pneumatyczne, nowe, gumowe',
    'Retreaded or used pneumatic tyres of rubber; solid or cushion tyres, tyre treads and tyre flaps, of rubber' => 'Opony pneumatyczne bieżnikowane lub używane, gumowe; opony pełne lub z poduszką powietrzną, bieżniki opon, ochraniacze dętek, gumowe',
    'Inner tubes, of rubber' => 'Dętki gumowe',
    'Hygienic or pharmaceutical articles (including teats), of vulcanised rubber other than hard rubber, with or without fittings of hard rubber' => 'Artykuły higieniczne lub farmaceutyczne (włącznie ze smoczkami), z gumy innej niż ebonit, z wyposażeniem z ebonitu lub bez',
    'Articles of apparel and clothing accessories (including gloves, mittens and mitts), for all purposes, of vulcanised rubber other than hard rubber' => 'Artykuły odzieżowe i dodatki odzieżowe (włącznie z rękawiczkami, mitenkami i rękawicami z jednym palcem), dowolnego przeznaczenia, z gumy innej niż ebonit',
    'Other articles of vulcanised rubber other than hard rubber' => 'Pozostałe artykuły z gumy innej niż ebonit',
    'Raw hides and skins of bovine (including buffalo) or equine animals (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not dehaired or split' => 'Skóry i skórki bydlęce, surowe (włączając bawole) lub ze zwierząt jednokopytnych (świeże lub solone, suszone, wapnione, piklowane lub inaczej konserwowane, ale niegarbowane, niewyprawione na pergamin lub dalej nieprzetworzone), nawet odwłoszone lub dwojone',
    'Raw skins of sheep or lambs (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not with wool on or split, other than those excluded by note 1(c) to this chapter' => 'Skóry surowe, owcze lub jagnięce (świeże lub solone, suszone, wapnione, piklowane lub inaczej konserwowane, ale niegarbowane, niewyprawione na pergamin lub dalej nieprzetworzone), nawet z wełną lub dwojone, inne niż te wyłączone uwagą 1 c) do niniejszego działu',
    'Other raw hides and skins (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not dehaired or split, other than those excluded by note 1(b) or 1(c) to this chapter' => 'Pozostałe skóry i skórki, surowe (świeże lub solone, suszone, wapnione, piklowane lub inaczej konserwowane, ale niegarbowane, niewyprawione na pergamin lub dalej nieprzetworzone), nawet odwłoszone lub dwojone, inne niż te wyłączone uwagą 1 b) lub c) do niniejszego działu',
    'Tanned or crust hides and skins of bovine (including buffalo) or equine animals, without hair on, whether or not split, but not further prepared' => 'Skóry i skórki garbowane lub crust bydlęce (włączając bawole) lub ze zwierząt jednokopytnych, bez włosa, nawet dwojone, ale dalej nieprzetworzone',
    'Tanned or crust skins of sheep or lambs, without wool on, whether or not split, but not further prepared' => 'Skóry owcze lub jagnięce, garbowane lub crust, bez wełny, nawet dwojone, ale dalej nieprzetworzone',
    'Tanned or crust hides and skins of other animals, without wool or hair on, whether or not split, but not further prepared' => 'Skóry i skórki z pozostałych zwierząt, garbowane lub crust, bez wełny lub włosa, nawet dwojone, ale dalej nieprzetworzone',
    'Leather further prepared after tanning or crusting, including parchment-dressed leather, of bovine (including buffalo) or equine animals, without hair on, whether or not split, other than leather of heading 4114' => 'Skóra wyprawiona dalej przetworzona po garbowaniu lub kondycjonowaniu, włączając skórę wyprawioną na pergamin, bydlęca (włączając bawolą) lub zwierząt jednokopytnych, bez włosa, nawet dwojona, inna niż skóra wyprawiona objęta pozycją 4114',
    'Leather further prepared after tanning or crusting, including parchment-dressed leather, of other animals, without wool or hair on, whether or not split, other than leather of heading 4114' => 'Skóra wyprawiona dalej przetworzona po garbowaniu lub kondycjonowaniu, włączając skórę wyprawioną na pergamin, z pozostałych zwierząt, bez wełny lub włosa, nawet dwojona, inna niż skóra wyprawiona objęta pozycją 4114',
    'Chamois (including combination chamois) leather; patent leather and patent laminated leather; metallised leather' => 'Skóra zamszowa (włączając zamsz kombinowany); skóra lakierowana i skóra lakierowana laminowana; skóra metalizowana',
    'Composition leather with a basis of leather or leather fibre, in slabs, sheets or strip, whether or not in rolls; parings and other waste of leather or of composition leather, not suitable for the manufacture of leather articles; leather dust, powder and flour' => 'Skóra wtórna na bazie skóry wyprawionej lub na bazie włókien ze skóry wyprawionej, w płytach, arkuszach lub pasach, nawet w zwojach; skrawki i pozostałe odpady skóry wyprawionej lub skóry wtórnej, nienadające się do produkcji artykułów skórzanych; pył, proszek i mączka ze skóry wyprawionej',
    'Trunks, suitcases, vanity cases, executive-cases, briefcases, school satchels, spectacle cases, binocular cases, camera cases, musical instrument cases, gun cases, holsters and similar containers; travelling-bags, insulated food or beverages bags, toilet bags, rucksacks, handbags, shopping-bags, wallets, purses, map-cases, cigarette-cases, tobacco-pouches, tool bags, sports bags, bottle-cases, jewellery boxes, powder boxes, cutlery cases and similar containers, of leather or of composition leather, of sheeting of plastics, of textile materials, of vulcanised fibre or of paperboard, or wholly or mainly covered with such materials or with paper' => 'Kufry, walizy, saszetki, teczki, aktówki, tornistry, futerały na okulary, lornetki, aparaty fotograficzne, instrumenty muzyczne, broń palną, kabury i podobne pojemniki; torby podróżne, izolowane torby na żywność lub napoje, kosmetyczki, plecaki, torebki, torby na zakupy, portfele, portmonetki, mapniki, papierośnice, woreczki na tytoń, torby na narzędzia, torby sportowe, pojemniki na butelki, pudełka na biżuterię, puderniczki, kasety na sztućce oraz podobne pojemniki, ze skóry wyprawionej lub skóry wtórnej, z folii z tworzywa sztucznego, z materiałów włókienniczych, z fibry lub tektury, lub całkowicie lub głównie pokryte takimi materiałami, lub papierem',
    'Articles of apparel and clothing accessories, of leather or of composition leather' => 'Artykuły odzieżowe i dodatki odzieżowe, ze skóry wyprawionej lub skóry wtórnej',
    'Other articles of leather or of composition leather' => 'Pozostałe artykuły ze skóry wyprawionej lub skóry wtórnej',
    'Raw furskins (including heads, tails, paws and other pieces or cuttings, suitable for furriers\' use), other than raw hides and skins of heading 4101, 4102 or 4103' => 'Skóry futerkowe surowe (włącznie z łbami, ogonami, łapami i pozostałymi częściami lub kawałkami nadającymi się do wykorzystania w kuśnierstwie), inne niż surowe skóry i skórki objęte pozycją 4101, 4102 lub 4103',
    'Tanned or dressed furskins (including heads, tails, paws and other pieces or cuttings), unassembled, or assembled (without the addition of other materials) other than those of heading 4303' => 'Skóry futerkowe garbowane lub wykończone (włącznie z łbami, ogonami, łapami i pozostałymi częściami lub kawałkami), niepołączone lub połączone (bez dodatków z innych materiałów), inne niż te objęte pozycją 4303',
    'Articles of apparel, clothing accessories and other articles of furskin' => 'Artykuły odzieżowe, dodatki odzieżowe i pozostałe artykuły ze skór futerkowych',
    'Fuel wood, in logs, in billets, in twigs, in faggots or in similar forms; wood in chips or particles; sawdust and wood waste and scrap, whether or not agglomerated in logs, briquettes, pellets or similar forms' => 'Drewno opałowe w postaci kłód, szczap, gałęzi, wiązek chrustu lub w podobnych postaciach; drewno w postaci wiórów lub kawałków; trociny, odpady i ścinki drewniane, nawet aglomerowane w kłody, brykiety, granulki lub w podobne postacie',
    'Wood charcoal (including shell or nut charcoal), whether or not agglomerated' => 'Węgiel drzewny (włączając węgiel drzewny z łupin lub orzechów), nawet aglomerowany',
    'Wood in the rough, whether or not stripped of bark or sapwood, or roughly squared' => 'Drewno surowe, nawet pozbawione kory lub bieli, lub zgrubnie obrobione',
    'Hoopwood; split poles; piles, pickets and stakes of wood, pointed but not sawn lengthwise; wooden sticks, roughly trimmed but not turned, bent or otherwise worked, suitable for the manufacture of walking sticks, umbrellas, tool handles or the like; chipwood and the like' => 'Obręcze drewniane; żerdzie rozszczepione; pale, paliki i kołki z drewna, zaostrzone, ale nieprzetarte wzdłużnie; tyczki drewniane, zgrubnie przycięte, ale nietoczone, niewygięte lub w inny sposób obrobione, nadające się do produkcji lasek, parasoli, rękojeści do narzędzi lub tym podobne; wióry i tym podobne',
    'Railway or tramway sleepers (cross-ties) of wood' => 'Podkłady kolejowe lub tramwajowe, z drewna',
    'Wood sawn or chipped lengthwise, sliced or peeled, whether or not planed, sanded or end-jointed, of a thickness exceeding 6 mm' => 'Drewno przetarte lub strugane wzdłużnie, skrawane warstwami lub obwodowo, nawet strugane, szlifowane lub łączone stykowo, o grubości przekraczającej 6 mm',
    'Sheets for veneering (including those obtained by slicing laminated wood), for plywood or for similar laminated wood and other wood, sawn lengthwise, sliced or peeled, whether or not planed, sanded, spliced or end-jointed, of a thickness not exceeding 6 mm' => 'Arkusze na forniry (włącznie z otrzymanymi przez cięcie drewna warstwowego), na sklejkę lub na podobne drewno warstwowe i inne drewno, przetarte wzdłużnie, skrawane warstwami lub obwodowo, nawet strugane, szlifowane, łączone na długość lub łączone stykowo, o grubości nieprzekraczającej 6 mm',
