    'Padlocks and locks (key, combination or electrically operated), of base metal; clasps and frames with clasps, incorporating locks, of base metal; keys for any of the foregoing articles, of base metal' => 'Kłódki i zamki (na klucze, szyfrowe lub elektryczne), z metalu nieszlachetnego; zamknięcia i okucia z zamknięciami, zawierające zamki, z metalu nieszlachetnego; klucze do dowolnych artykułów wyżej wymienionych, z metalu nieszlachetnego',
    'Base-metal mountings, fittings and similar articles suitable for furniture, doors, staircases, windows, blinds, coachwork, saddlery, trunks, chests, caskets or the like; base-metal hat-racks, hat-pegs, brackets and similar fixtures; castors with mountings of base metal; automatic door closers of base metal' => 'Oprawy, okucia i podobne artykuły z metalu nieszlachetnego, nadające się do mebli, drzwi, schodów, okien, żaluzji, nadwozi pojazdów, wyrobów rymarskich, waliz, kufrów, kasetek lub temu podobnych; wieszaki, podpórki i podobne uchwyty z metalu nieszlachetnego; kółka samonastawne z zamocowaniem, z metalu nieszlachetnego; automatyczne urządzenia do zamykania drzwi z metalu nieszlachetnego',
    'Armoured or reinforced safes, strongboxes and doors and safe deposit lockers for strong-rooms, cash or deed boxes and the like, of base metal' => 'Opancerzone lub wzmocnione sejfy, kasy oraz drzwi i szafki na depozyty do skarbców, kasetki na pieniądze lub dokumenty i temu podobne, z metali nieszlachetnych',
