    'Bells, gongs and the like, non-electric, of base metal; statuettes and other ornaments, of base metal; photograph, picture or similar frames, of base metal; mirrors of base metal' => 'Dzwonki, gongi i temu podobne, nieelektryczne, z metali nieszlachetnych; statuetki i pozostałe ozdoby, z metali nieszlachetnych; ramy do fotografii, obrazów lub podobne, z metali nieszlachetnych; lustra z metali nieszlachetnych',
    'Flexible tubing of base metal, with or without fittings' => 'Przewody rurowe giętkie z metali nieszlachetnych, z łącznikami lub bez',
