    'Nuclear reactors; fuel elements (cartridges), non-irradiated, for nuclear reactors; machinery and apparatus for isotopic separation' => 'Reaktory jądrowe; sekcje paliwowe (kasety), nienapromieniowane, do reaktorów jądrowych; maszyny i aparatura do rozdzielania izotopów',
    'Steam or other vapour generating boilers (other than central heating hot water boilers capable also of producing low pressure steam); superheated water boilers' => 'Kotły wytwarzające parę wodną lub inną parę (inne niż kotły centralnego ogrzewania do gorącej wody, mogące również wytwarzać parę o niskim ciśnieniu); kotły wodne wysokotemperaturowe',
    'Central heating boilers other than those of heading 8402' => 'Kotły centralnego ogrzewania, inne niż te objęte pozycją 8402',
