    'Producer gas or water gas generators, with or without their purifiers; acetylene gas generators and similar water process gas generators, with or without their purifiers' => 'Wytwornice gazu generatorowego lub wodnego, z oczyszczalnikami wytwarzanego gazu lub bez nich; wytwornice acetylenu i podobne wytwornice gazu metodą wodną, z oczyszczalnikami wytwarzanego gazu lub bez nich',
    'Steam turbines and other vapour turbines' => 'Turbiny na parę wodną i turbiny na inne rodzaje pary',
    'Spark-ignition reciprocating or rotary internal combustion piston engines' => 'Silniki spalinowe z zapłonem iskrowym z tłokami wykonującymi ruch posuwisto-zwrotny lub obrotowy',
