    'Parts suitable for use solely or principally with the engines of heading 8407 or 8408' => 'Części nadające się do stosowania wyłącznie lub głównie do silników objętych pozycją 8407 lub 8408',
    'Hydraulic turbines, water wheels, and regulators therefor' => 'Turbiny hydrauliczne, koła wodne oraz ich regulatory',
