    'Air-conditioning machines, comprising a motor-driven fan and elements for changing the temperature and humidity, including those machines in which the humidity cannot be separately regulated' => 'Klimatyzatory, zawierające wentylator napędzany silnikiem oraz elementy służące do zmiany temperatury i wilgotności, włączając klimatyzatory nieposiadające możliwości oddzielnej regulacji wilgotności',
    'Furnace burners for liquid fuel, for pulverised solid fuel or for gas; mechanical stokers, including their mechanical grates, mechanical ash dischargers and similar appliances' => 'Palniki piecowe na paliwo ciekłe, na paliwo stałe pyłowe lub na gaz; mechaniczne podajniki węgla, włączając ich ruszty mechaniczne, mechaniczne urządzenia do usuwania popiołu oraz podobne urządzenia',
    'Industrial or laboratory furnaces and ovens, including incinerators, non-electric' => 'Piece i paleniska przemysłowe lub laboratoryjne, włączając piece do spopielania, nieelektryczne',
