    'Centrifuges, including centrifugal dryers; filtering or purifying machinery and apparatus, for liquids or gases' => 'Wirówki, włączając suszarki wirówkowe; urządzenia i aparatura do filtrowania lub oczyszczania cieczy lub gazów',
    'Dishwashing machines; machinery for cleaning or drying bottles or other containers; machinery for filling, closing, sealing or labelling bottles, cans, boxes, bags or other containers; machinery for capsuling bottles, jars, tubes and similar containers; other packing or wrapping machinery (including heat-shrink wrapping machinery); machinery for aerating beverages' => 'Zmywarki do naczyń; urządzenia do czyszczenia lub suszenia butelek lub innych pojemników; urządzenia do napełniania, zamykania, uszczelniania lub etykietowania butelek, tubek, puszek, pudełek, worków lub innych pojemników; urządzenia do kapslowania butelek, słoików lub podobnych pojemników; pozostałe urządzenia do pakowania lub paczkowania (włączając urządzenia do pakowania termokurczliwego); urządzenia do gazowania napojów',
