    'Mechanical appliances (whether or not hand-operated) for projecting, dispersing or spraying liquids or powders; fire extinguishers, whether or not charged; spray guns and similar appliances; steam or sandblasting machines and similar jet projecting machines' => 'Urządzenia mechaniczne (nawet obsługiwane ręcznie) do rozrzucania, rozpraszania lub rozpylania cieczy lub proszków; gaśnice, nawet napełnione; pistolety natryskowe i podobne urządzenia; maszyny do wytwarzania strumienia pary lub piasku i podobne maszyny wytwarzające strumień czynnika roboczego',
    'Pulley tackle and hoists other than skip hoists; winches and capstans; jacks' => 'Wielokrążki i wciągniki, inne niż wyciągi pochyłe; wciągarki i przyciągarki; podnośniki',
    'Ships\' derricks; cranes, including cable cranes; mobile lifting frames, straddle carriers and works trucks fitted with a crane' => 'Okrętowe żurawie masztowe; dźwignice, włączając linomostowe; bramownice drogowe, wozy okraczające podsiębierne oraz wozy i wózki transportu wewnętrznego z urządzeniami dźwigowymi',
