    'Parts suitable for use solely or principally with the machinery of headings 8425 to 8430' => 'Części nadające się do stosowania wyłącznie lub głównie do urządzeń objętych pozycjami od 8425 do 8430',
    'Agricultural, horticultural or forestry machinery for soil preparation or cultivation; lawn or sports-ground rollers' => 'Maszyny rolnicze, ogrodnicze lub leśne do przygotowywania lub uprawy gleby; walce do pielęgnacji trawników lub terenów sportowych',
