    'Milking machines and dairy machinery' => 'Dojarki mechaniczne i urządzenia mleczarskie',
    'Presses, crushers and similar machinery used in the manufacture of wine, cider, fruit juices or similar beverages' => 'Prasy, tłocznie, rozdrabniacze i podobne urządzenia stosowane w produkcji wina, jabłecznika, soków owocowych lub podobnych napojów',
