    'Machines for cleaning, sorting or grading seed, grain or dried leguminous vegetables; machinery used in the milling industry or for the working of cereals or dried leguminous vegetables, other than farm-type machinery' => 'Urządzenia do czyszczenia, sortowania lub klasyfikowania nasion, ziarna lub suszonych warzyw strączkowych; urządzenia stosowane w przemyśle zbożowym lub do obróbki zbóż, lub suszonych warzyw strączkowych, inne niż urządzenia stosowane w gospodarstwie rolnym',
    'Machinery, not specified or included elsewhere in this chapter, for the industrial preparation or manufacture of food or drink, other than machinery for the extraction or preparation of animal or fixed vegetable or microbial fats or oils' => 'Maszyny, niewymienione ani niewłączone gdzie indziej w niniejszym dziale, do przemysłowego przygotowywania lub produkcji żywności, napojów, inne niż maszyny do otrzymywania lub przyrządzania tłuszczów lub olejów zwierzęcych, roślinnych lub mikrobiologicznych',
    'Machinery for making pulp of fibrous cellulosic material or for making or finishing paper or paperboard' => 'Urządzenia do wytwarzania masy włóknistego materiału celulozowego lub do wytwarzania, lub obróbki wykończającej papier lub tekturę',
    'Bookbinding machinery, including book-sewing machines' => 'Maszyny introligatorskie, włączając niciarki',
    'Other machinery for making up paper pulp, paper or paperboard, including cutting machines of all kinds' => 'Pozostałe urządzenia do wytwarzania masy papierniczej, papieru lub tektury, włączając krajarki i krajalnice wszelkich typów',
    'Machinery, apparatus and equipment (other than the machines of headings 8456 to 8465) for preparing or making plates, cylinders or other printing components; plates, cylinders and other printing components; plates, cylinders and lithographic stones, prepared for printing purposes (for example, planed, grained or polished)' => 'Maszyny, urządzenia i wyposażenie (inne niż maszyny objęte pozycjami od 8456 do 8465) do przygotowywania lub wykonywania płyt, cylindrów lub innych elementów drukarskich; płyty, cylindry i inne elementy drukarskie; płyty, cylindry i kamienie litograficzne, przygotowane do celów drukarskich (na przykład strugane, ziarnowane lub polerowane)',
    'Printing machinery used for printing by means of plates, cylinders and other printing components of heading 8442; other printers, copying machines and facsimile machines, whether or not combined; parts and accessories thereof' => 'Maszyny drukarskie stosowane do drukowania za pomocą płyt, cylindrów i innych elementów drukarskich objętych pozycją 8442; pozostałe drukarki, urządzenia kopiujące i telekopiarki, nawet połączone; ich części i akcesoria',
    'Machines for extruding, drawing, texturing or cutting man-made textile materials' => 'Maszyny do wytłaczania, rozciągania, teksturowania lub cięcia materiałów włókienniczych chemicznych',
    'Machines for preparing textile fibres; spinning, doubling or twisting machines and other machinery for producing textile yarns; textile reeling or winding (including weft-winding) machines and machines for preparing textile yarns for use on the machines of heading 8446 or 8447' => 'Maszyny do przygotowywania włókien tekstylnych; przędzarki, łączniarki lub skręcarki oraz pozostałe maszyny do wytwarzania przędzy włókienniczej; motarki lub przewijarki (włączając przewijarki wątkowe), włókiennicze oraz maszyny do przygotowania przędzy włókienniczej do stosowania na maszynach objętych pozycją 8446 lub 8447',
    'Weaving machines (looms)' => 'Maszyny tkackie (krosna)',
