    'Auxiliary machinery for use with machines of heading 8444, 8445, 8446 or 8447 (for example, dobbies, jacquards, automatic stop motions, shuttle changing mechanisms); parts and accessories suitable for use solely or principally with the machines of this heading or of heading 8444, 8445, 8446 or 8447 (for example, spindles and spindle flyers, card clothing, combs, extruding nipples, shuttles, healds and heald-frames, hosiery needles)' => 'Urządzenia pomocnicze stosowane z maszynami objętymi pozycja 8444, 8445, 8446 lub 8447 (na przykład nicielnice, żakardy, automatyczne mechanizmy zatrzymujące, mechanizmy do zmiany czółenek); części i akcesoria nadające się do stosowania wyłącznie lub głównie z maszynami i urządzeniami objętymi niniejszą pozycją lub pozycją 8444, 8445, 8446 lub 8447 (na przykład wrzeciona i skrzydełka wrzecion, obicia zgrzeblarskie, grzebienie, filiery, czółenka, struny nicielnicowe i ramki nicielnic, igły do wyrobów pończoszniczych)',
    'Household or laundry-type washing machines, including machines which both wash and dry' => 'Maszyny pralnicze typu domowego lub profesjonalnego, włączając maszyny piorąco-suszące',
