    'Sewing machines, other than book-sewing machines of heading 8440; furniture, bases and covers specially designed for sewing machines; sewing machine needles' => 'Maszyny do szycia, inne niż maszyny do zszywania książek, objęte pozycją 8440; meble, podstawy i obudowy specjalnie zaprojektowane do maszyn do szycia; igły do maszyn do szycia',
    'Machinery for preparing, tanning or working hides, skins or leather or for making or repairing footwear or other articles of hides, skins or leather, other than sewing machines' => 'Maszyny i urządzenia do przygotowywania, garbowania lub obróbki skór, skórek lub skóry wyprawionej, lub do wyrobu, lub naprawy obuwia, lub innych artykułów ze skór, skórek lub skóry wyprawionej, inne niż maszyny do szycia',
    'Converters, ladles, ingot moulds and casting machines, of a kind used in metallurgy or in metal foundries' => 'Konwertory, kadzie, wlewnice i maszyny odlewnicze, w rodzaju stosowanych w hutnictwie lub w odlewniach metali',
    'Metal-rolling mills and rolls therefor' => 'Walcarki do metali oraz ich walce',
    'Machine tools for working any material by removal of material, by laser or other light or photon beam, ultrasonic, electrodischarge, electrochemical, electron beam, ionic-beam or plasma arc processes; water-jet cutting machines' => 'Obrabiarki do obróbki dowolnego materiału przez usuwanie materiału za pomocą lasera lub innej wiązki światła lub fotonów, metodą ultradźwiękową, elektroerozyjną, elektrochemiczną, za pomocą wiązki elektronów, wiązki jonów lub łuku plazmowego; maszyny do cięcia strumieniem wody',
    'Machining centres, unit construction machines (single station) and multi-station transfer machines, for working metal' => 'Centra obróbkowe, obrabiarki zespołowe (jednostanowiskowe) i wielostanowiskowe obrabiarki przestawialne, do metalu',
