    'Machine tools (including way-type unit head machines) for drilling, boring, milling, threading or tapping by removing metal, other than lathes (including turning centres) of heading 8458' => 'Obrabiarki (włączając obrabiarki z jednostkami obróbkowymi prowadnicowymi) do wiercenia, wytaczania, frezowania lub gwintowania wałków lub otworów, do obróbki metalu przez jego skrawanie, inne niż tokarki (włączając centra tokarskie) objęte pozycją 8458',
    'Machine tools for deburring, sharpening, grinding, honing, lapping, polishing or otherwise finishing metal or cermets by means of grinding stones, abrasives or polishing products, other than gear cutting, gear grinding or gear finishing machines of heading 8461' => 'Obrabiarki do usuwania zadziorów i stępiania ostrych krawędzi, do ostrzenia, szlifowania, gładzenia, docierania, polerowania lub innej obróbki wykończającej powierzchnie metali lub cermetali za pomocą toczaków (okrągłych tarcz z piaskowca do ostrzenia narzędzi), narzędzi i materiałów ściernych lub polerujących, inne niż obrabiarki do nacinania, szlifowania lub obróbki wykończającej uzębień kół zębatych, objęte pozycją 8461',
    'Machine tools for planing, shaping, slotting, broaching, gear cutting, gear grinding or gear finishing, sawing, cutting-off and other machine tools working by removing metal or cermets, not elsewhere specified or included' => 'Obrabiarki do strugania wzdłużnego, strugania poprzecznego, dłutowania, przeciągania, do nacinania, szlifowania lub obróbki wykończającej uzębień, do piłowania, obcinania lub przecinania oraz pozostałe obrabiarki działające przez skrawanie metalu, cermetali, gdzie indziej niewymienione ani niewłączone',
    'Machine tools (including presses) for working metal by forging, hammering or die forging (excluding rolling mills); machine tools (including presses, slitting lines and cut-to-length lines) for working metal by bending, folding, straightening, flattening, shearing, punching, notching or nibbling (excluding draw-benches); presses for working metal or metal carbides, not specified above' => 'Obrabiarki (włączając prasy) do obróbki metalu metodą kucia, młotkowania lub kucia matrycowego (z wyłączeniem walcarek); obrabiarki (włączając prasy, linie do cięcia wzdłużnego i linie do cięcia na długość) do obróbki metalu metodą gięcia, składania, prostowania, spłaszczania, ścinania, przebijania, dziurkowania lub nacinania (z wyłączeniem ciągarek); prasy do obróbki metali lub węglików metali, wyżej niewymienione',
    'Other machine tools for working metal or cermets, without removing material' => 'Pozostałe obrabiarki do obróbki metalu lub cermetali, bez usuwania materiału',
    'Machine tools for working stone, ceramics, concrete, asbestos-cement or like mineral materials or for cold working glass' => 'Obrabiarki do kamienia, materiałów ceramicznych, betonu, wyrobów azbestowo-cementowych lub podobnych materiałów mineralnych, lub do obróbki szkła na zimno',
    'Machine tools (including machines for nailing, stapling, glueing or otherwise assembling) for working wood, cork, bone, hard rubber, hard plastics or similar hard materials' => 'Obrabiarki (włączając maszyny do wbijania gwoździ, do łączenia klamrami, klejenia lub innego łączenia) do obróbki drewna, korka, kości, ebonitu, twardych tworzyw sztucznych lub podobnych twardych materiałów',
    'Parts and accessories suitable for use solely or principally with the machines of headings 8456 to 8465, including work or tool holders, self-opening dieheads, dividing heads and other special attachments for the machines; tool holders for any type of tool for working in the hand' => 'Części i akcesoria nadające się do stosowania wyłącznie lub głównie do maszyn objętych pozycjami od 8456 do 8465, włączając uchwyty przedmiotów obrabianych, uchwyty narzędzi, głowice gwinciarskie maszynowe (samootwierające), podzielnice i pozostałe urządzenia specjalne do maszyn; uchwyty do narzędzi wszelkich typów do obróbki ręcznej',
    'Tools for working in the hand, pneumatic, hydraulic or with self-contained electric or non-electric motor' => 'Narzędzia ręczne, pneumatyczne, hydrauliczne lub z samodzielnym silnikiem elektrycznym lub nieelektrycznym',
    'Machinery and apparatus for soldering, brazing or welding, whether or not capable of cutting, other than those of heading 8515; gas-operated surface tempering machines and appliances' => 'Maszyny i urządzenia do lutowania miękkiego i twardego, spawania lub zgrzewania, nawet przystosowane do cięcia, inne niż te objęte pozycją 8515; maszyny i urządzenia do gazowego odpuszczania powierzchniowego',
    'Calculating machines and pocket-size data-recording, reproducing and displaying machines with calculating functions; accounting machines, postage-franking machines, ticket-issuing machines and similar machines, incorporating a calculating device; cash registers' => 'Maszyny liczące i kieszonkowe maszyny z funkcjami liczącymi do zapisu, odtwarzania i wyświetlania danych; maszyny do księgowania, frankowania, maszyny do wydawania biletów i podobne maszyny, wyposażone w urządzenia liczące; kasy rejestrujące',
    'Automatic data-processing machines and units thereof; magnetic or optical readers, machines for transcribing data onto data media in coded form and machines for processing such data, not elsewhere specified or included' => 'Maszyny do automatycznego przetwarzania danych i urządzenia do nich; czytniki magnetyczne lub optyczne, maszyny do przenoszenia danych w postaci zakodowanej na nośniki danych oraz maszyny do przetwarzania takich danych, gdzie indziej niewymienione ani niewłączone',
    'Other office machines (for example, hectograph or stencil duplicating machines, addressing machines, automatic banknote dispensers, coin-sorting machines, coin-counting or -wrapping machines, pencil-sharpening machines, perforating or stapling machines)' => 'Pozostałe maszyny biurowe (na przykład hektografy lub powielacze białkowe, maszyny adresujące, automaty wydające banknoty, maszyny do sortowania, liczenia lub pakowania monet, urządzenia do temperowania ołówków, dziurkacze lub zszywacze)',
    'Parts and accessories (other than covers, carrying cases and the like) suitable for use solely or principally with machines of headings 8470 to 8472' => 'Części i akcesoria (inne niż pokrowce, futerały i tym podobne) nadające się do stosowania wyłącznie lub głównie z maszynami objętymi pozycjami od 8470 do 8472',
    'Machinery for sorting, screening, separating, washing, crushing, grinding, mixing or kneading earth, stone, ores or other mineral substances, in solid (including powder or paste) form; machinery for agglomerating, shaping or moulding solid mineral fuels, ceramic paste, unhardened cements, plastering materials or other mineral products in powder or paste form; machines for forming foundry moulds of sand' => 'Maszyny do sortowania, klasyfikowania, przesiewania, separowania, płukania, przemywania, zgniatania, kruszenia, mielenia, mieszania lub ugniatania ziemi, kamieni, rud lub pozostałych substancji mineralnych, w postaci stałej (włączając proszek lub pastę); maszyny do aglomerowania, kształtowania lub formowania stałych paliw mineralnych, mas ceramicznych, nieutwardzonego cementu, materiałów gipsowych lub pozostałych produktów mineralnych w postaci proszku lub pasty; maszyny do wykonywania piaskowych form odlewniczych',
    'Machines for assembling electric or electronic lamps, tubes or valves or flashbulbs, in glass envelopes; machines for manufacturing or hot working glass or glassware' => 'Maszyny do montażu lamp elektrycznych lub elektronicznych, lamp elektronowych lub fotograficznych lamp błyskowych, w bańkach szklanych; maszyny do wyrobu lub obróbki na gorąco szkła lub wyrobów szklanych',
    'Automatic goods-vending machines (for example, postage stamp, cigarette, food or beverage machines), including money-changing machines' => 'Automaty do sprzedaży różnych towarów (na przykład znaczków pocztowych, papierosów, potraw lub napojów), włączając automaty do rozmieniania pieniędzy',
    'Machinery for working rubber or plastics or for the manufacture of products from these materials, not specified or included elsewhere in this chapter' => 'Maszyny do obróbki gumy lub tworzyw sztucznych lub do produkcji wyrobów z tych materiałów, niewymienione ani niewłączone gdzie indziej w niniejszym dziale',
    'Machinery for preparing or making up tobacco, not specified or included elsewhere in this chapter' => 'Maszyny do przygotowywania lub przerobu tytoniu, niewymienione ani niewłączone gdzie indziej w niniejszym dziale',
    'Machines and mechanical appliances having individual functions, not specified or included elsewhere in this chapter' => 'Maszyny i urządzenia, mechaniczne, posiadające indywidualne funkcje, niewymienione ani niewłączone gdzie indziej w niniejszym dziale',
    'Moulding boxes for metal foundry; mould bases; moulding patterns; moulds for metal (other than ingot moulds), metal carbides, glass, mineral materials, rubber or plastics' => 'Skrzynki formierskie dla odlewni metali; płyty podmodelowe; modele odlewnicze; formy do metali (inne niż wlewnice), węglików metali, szkła, materiałów mineralnych, gumy lub tworzyw sztucznych',
    'Taps, cocks, valves and similar appliances for pipes, boiler shells, tanks, vats or the like, including pressure-reducing valves and thermostatically controlled valves' => 'Krany, kurki, zawory i podobna armatura do rur, płaszczy kotłów, zbiorników, kadzi lub tym podobnych, włączając zawory redukcyjne i zawory sterowane termostatycznie',
    'Ball or roller bearings' => 'Łożyska toczne',
    'Transmission shafts (including cam shafts and crank shafts) and cranks; bearing housings and plain shaft bearings; gears and gearing; ball or roller screws; gear boxes and other speed changers, including torque converters; flywheels and pulleys, including pulley blocks; clutches and shaft couplings (including universal joints)' => 'Wały napędowe (włączając wały krzywkowe i wały wykorbione) i korby; obudowy łożysk i łożyska ślizgowe; mechanizmy i przekładnie zębate; mechanizmy śrubowo-kulkowe lub śrubowo-wałeczkowe; skrzynie przekładniowe i pozostałe układy zmieniające prędkość, włączając przemienniki momentu obrotowego; koła zamachowe i koła pasowe lub linowe, włączając wielokrążki i zblocza; sprzęgła rozłączne i nierozłączne (włączając przeguby uniwersalne)',
    'Gaskets and similar joints of metal sheeting combined with other material or of two or more layers of metal; sets or assortments of gaskets and similar joints, dissimilar in composition, put up in pouches, envelopes or similar packings; mechanical seals' => 'Uszczelki i podobne przekładki, z cienkiej blachy łączonej z innym materiałem lub z dwoma lub więcej warstwami metalu; zestawy lub komplety uszczelek i podobnych przekładek, różniących się między sobą, pakowane w torebki, koperty lub podobne opakowania; uszczelnienia mechaniczne',
    'Machines for additive manufacturing' => 'Maszyny do wytwarzania przyrostowego',
    'Machines and apparatus of a kind used solely or principally for the manufacture of semiconductor boules or wafers, semiconductor devices, electronic integrated circuits or flat panel displays; machines and apparatus specified in note 11(C) to this chapter; parts and accessories' => 'Maszyny i aparatura w rodzaju stosowanych wyłącznie lub głównie do produkcji kryształów półprzewodnikowych lub płytek półprzewodnikowych, elementów półprzewodnikowych, elektronicznych układów scalonych lub płaskich wyświetlaczy; maszyny i aparaty wyszczególnione w uwadze 11 C do niniejszego działu; części i akcesoria',
    'Machinery parts, not containing electrical connectors, insulators, coils, contacts or other electrical features, not specified or included elsewhere in this chapter' => 'Części maszyn i urządzeń niezawierające złączy elektrycznych, izolatorów, uzwojeń, styków lub innych części elektrycznych, niewymienione ani niewłączone gdzie indziej w niniejszym dziale',
    'Electric motors and generators (excluding generating sets)' => 'Silniki elektryczne i prądnice (z wyłączeniem zespołów prądotwórczych)',
    'Electric generating sets and rotary converters' => 'Zespoły prądotwórcze oraz przetwornice jednotwornikowe',
    'Parts suitable for use solely or principally with the machines of heading 8501 or 8502' => 'Części nadające się wyłącznie lub głównie do maszyn objętych pozycją 8501 lub 8502',
    'Electrical transformers, static converters (for example, rectifiers) and inductors' => 'Transformatory elektryczne, przekształtniki (na przykład prostowniki) oraz cewki indukcyjne',
