    'Vacuum cleaners' => 'Odkurzacze',
    'Electromechanical domestic appliances, with self-contained electric motor, other than vacuum cleaners of heading 8508' => 'Elektromechaniczny sprzęt gospodarstwa domowego z własnym silnikiem elektrycznym, inny niż odkurzacze objęte pozycją 8508',
    'Shavers, hair clippers and hair-removing appliances, with self-contained electric motor' => 'Golarki, maszynki do strzyżenia i urządzenia do usuwania owłosienia, z własnym silnikiem elektrycznym',
    'Electrical ignition or starting equipment of a kind used for spark-ignition or compression-ignition internal combustion engines (for example, ignition magnetos, magneto-dynamos, ignition coils, sparking plugs and glow plugs, starter motors); generators (for example, dynamos, alternators) and cut-outs of a kind used in conjunction with such engines' => 'Elektryczne urządzenia zapłonowe lub rozrusznikowe, w rodzaju stosowanych w silnikach wewnętrznego spalania o zapłonie iskrowym lub samoczynnym (na przykład iskrowniki, prądnice iskrownikowe, cewki zapłonowe, świece zapłonowe, świece żarowe, silniki rozruszników); prądnice (na przykład prądu stałego lub przemiennego) oraz wyłączniki współpracujące z takimi silnikami',
    'Electrical lighting or signalling equipment (excluding articles of heading 8539), windscreen wipers, defrosters and demisters, of a kind used for cycles or motor vehicles' => 'Elektryczny sprzęt oświetleniowy i sygnalizacyjny (z wyłączeniem artykułów objętych pozycją 8539), elektryczne wycieraczki szyb, urządzenia zapobiegające zamarzaniu i zaparowaniu szyb, w rodzaju stosowanych w rowerach i w pojazdach silnikowych',
    'Portable electric lamps designed to function by their own source of energy (for example, dry batteries, accumulators, magnetos), other than lighting equipment of heading 8512' => 'Przenośne lampy elektryczne przystosowane do zasilania z własnego źródła energii (na przykład suchych baterii, akumulatorów, prądnic), inne niż sprzęt oświetleniowy objęty pozycją 8512',
    'Industrial or laboratory electric furnaces and ovens (including those functioning by induction or dielectric loss); other industrial or laboratory equipment for the heat treatment of materials by induction or dielectric loss' => 'Elektryczne piece przemysłowe lub laboratoryjne (włączając działające na zasadzie indukcji lub strat dielektrycznych); inne urządzenia przemysłowe lub laboratoryjne, do obróbki cieplnej materiałów, działające na zasadzie indukcji lub strat dielektrycznych',
    'Electric (including electrically heated gas), laser or other light or photon beam, ultrasonic, electron beam, magnetic pulse or plasma arc soldering, brazing or welding machines and apparatus, whether or not capable of cutting; electric machines and apparatus for hot spraying of metals or cermets' => 'Elektryczne (włączając gazowe ogrzewane elektrycznie), maszyny i aparatura do lutowania miękkiego, lutowania twardego lub spawania, metodą laserową lub inną wiązką światła lub fotonów, ultradźwiękami, wiązką elektronów, impulsów magnetycznych lub łuku plazmowego, nawet nadające się do cięcia; elektryczne maszyny i aparatura do natryskiwania na gorąco metali lub cermetali',
    'Electric instantaneous or storage water heaters and immersion heaters; electric space-heating apparatus and soil-heating apparatus; electrothermic hairdressing apparatus (for example, hairdryers, hair curlers, curling tong heaters) and hand dryers; electric smoothing irons; other electrothermic appliances of a kind used for domestic purposes; electric heating resistors, other than those of heading 8545' => 'Podgrzewacze do wody, natychmiastowe lub zbiornikowe oraz grzałki nurnikowe, elektryczne; aparatura do ogrzewania gleby i pomieszczeń, elektryczna; przyrządy fryzjerskie (na przykład suszarki do włosów, termoloki, lokówki) oraz suszarki do rąk, elektrotermiczne; żelazka do prasowania, elektryczne; urządzenia elektrotermiczne, w rodzaju stosowanych do użytku domowego; elektryczne rezystory grzejne, inne niż te objęte pozycją 8545',
    'Telephone sets, including smartphones and other telephones for cellular networks or for other wireless networks; other apparatus for the transmission or reception of voice, images or other data, including apparatus for communication in a wired or wireless network (such as a local or wide area network), other than transmission or reception apparatus of heading 8443, 8525, 8527 or 8528' => 'Aparaty telefoniczne, włączając smartfony i inne telefony do sieci komórkowych lub do innych sieci bezprzewodowych; pozostała aparatura do transmisji lub odbioru głosu, obrazów lub innych danych, włączając aparaturę do komunikacji w sieci przewodowej lub bezprzewodowej (takiej jak lokalna lub rozległa sieć komputerowa), inna niż aparatura nadawcza i odbiorcza objęta pozycją 8443, 8525, 8527 lub 8528',
    'Microphones and stands therefor; loudspeakers, whether or not mounted in their enclosures; headphones and earphones, whether or not combined with a microphone, and sets consisting of a microphone and one or more loudspeakers; audio-frequency electric amplifiers; electric sound amplifier sets' => 'Mikrofony i ich stojaki; głośniki, nawet zamontowane w swoich obudowach; słuchawki nagłowne i douszne, nawet połączone z mikrofonem oraz zestawy składające się z mikrofonu i jednego lub więcej głośników; wzmacniacze częstotliwości akustycznych, elektryczne; zestawy wzmacniające dźwięk, elektryczne',
    'Sound recording or sound reproducing apparatus' => 'Aparatura do rejestrowania lub odtwarzania dźwięku',
    'Video recording or reproducing apparatus, whether or not incorporating a video tuner' => 'Aparatura do zapisu lub odtwarzania obrazu i dźwięku, nawet z wbudowanym urządzeniem do odbioru sygnałów wizyjnych i dźwiękowych (tunerem wideo)',
    'Parts and accessories suitable for use solely or principally with the apparatus of heading 8519 or 8521' => 'Części i akcesoria nadające się do stosowania wyłącznie lub głównie z aparaturą objętą pozycją 8519 lub 8521',
    'Discs, tapes, solid-state non-volatile storage devices, smart cards and other media for the recording of sound or of other phenomena, whether or not recorded, including matrices and masters for the production of discs, but excluding products of Chapter 37' => 'Dyski, taśmy, półprzewodnikowe urządzenia pamięci trwałej, karty inteligentne i inne nośniki do rejestrowania dźwięku lub innych zjawisk, nawet nagrane, włączając matryce i wzorce do produkcji dysków, ale wyłączając produkty objęte działem 37',
    'Flat panel display modules, whether or not incorporating touch-sensitive screens' => 'Moduły płaskich wyświetlaczy, nawet zawierające ekrany dotykowe',
    'Transmission apparatus for radio-broadcasting or television, whether or not incorporating reception apparatus or sound recording or reproducing apparatus; television cameras, digital cameras and video camera recorders' => 'Aparatura nadawcza do radiofonii lub telewizji, nawet zawierająca aparaturę odbiorczą lub aparaturę zapisującą lub odtwarzającą dźwięk; kamery telewizyjne, kamery i aparaty cyfrowe oraz rejestrujące kamery wideo',
    'Radar apparatus, radio navigational aid apparatus and radio remote control apparatus' => 'Aparatura radarowa, radionawigacyjna oraz do zdalnego sterowania drogą radiową',
    'Reception apparatus for radio-broadcasting, whether or not combined, in the same housing, with sound recording or reproducing apparatus or a clock' => 'Aparatura odbiorcza do radiofonii, nawet połączona w tej samej obudowie z aparaturą do zapisu lub odtwarzania dźwięku lub zegarem',
    'Monitors and projectors, not incorporating television reception apparatus; reception apparatus for television, whether or not incorporating radio-broadcast receivers or sound or video recording or reproducing apparatus' => 'Monitory i projektory, niezawierające aparatury odbiorczej do telewizji; aparatura odbiorcza do telewizji, nawet zawierająca odbiorniki radiowe lub aparaturę do zapisu lub odtwarzania dźwięku lub obrazu',
    'Parts suitable for use solely or principally with the apparatus of headings 8524 to 8528' => 'Części nadające się do stosowania wyłącznie lub głównie z aparaturą objętą pozycjami od 8524 do 8528',
    'Electrical signalling, safety or traffic control equipment for railways, tramways, roads, inland waterways, parking facilities, port installations or airfields (other than those of heading 8608)' => 'Urządzenia sygnalizacyjne elektryczne, zapewniające bezpieczeństwo lub regulujące ruch kolejowy, tramwajowy, drogowy, na wodach śródlądowych, parkingach, portach lub lotniskach (inne niż te objęte pozycją 8608)',
    'Electric sound or visual signalling apparatus (for example, bells, sirens, indicator panels, burglar or fire alarms), other than those of heading 8512 or 8530' => 'Aparatura do sygnalizacji dźwiękowej lub wzrokowej (na przykład dzwonki, syreny, panele wskaźnikowe, urządzenia alarmowe przeciwwłamaniowe lub przeciwpożarowe), elektryczna, inna niż ta objęta pozycją 8512 lub 8530',
    'Electrical capacitors, fixed, variable or adjustable (pre-set)' => 'Kondensatory elektryczne, stałe, nastawne lub strojeniowe',
    'Electrical resistors (including rheostats and potentiometers), other than heating resistors' => 'Rezystory (włączając reostaty i potencjometry), inne niż rezystory grzejne',
    'Printed circuits' => 'Obwody drukowane',
    'Electrical apparatus for switching or protecting electrical circuits, or for making connections to or in electrical circuits (for example, switches, fuses, lightning arresters, voltage limiters, surge suppressors, plugs and other connectors, junction boxes), for a voltage exceeding 1000 V' => 'Urządzenia elektryczne do przełączania lub zabezpieczania obwodów elektrycznych, lub do wykonywania połączeń w obwodach elektrycznych, lub do tych obwodów (na przykład przełączniki, bezpieczniki, odgromniki, ograniczniki napięcia, tłumiki przepięciowe, wtyki i inne złącza, skrzynki przyłączowe), do napięć przekraczających 1000 V',
    'Electrical apparatus for switching or protecting electrical circuits, or for making connections to or in electrical circuits (for example, switches, relays, fuses, surge suppressors, plugs, sockets, lamp holders and other connectors, junction boxes), for a voltage not exceeding 1000 V; connectors for optical fibres, optical fibre bundles or cables' => 'Urządzenia elektryczne do przełączania lub zabezpieczania obwodów elektrycznych, lub do wykonywania połączeń w obwodach elektrycznych, lub do tych obwodów (na przykład przełączniki, przekaźniki, bezpieczniki, tłumiki przepięciowe, wtyki, gniazda wtykowe, oprawki lamp i inne złącza, skrzynki przyłączowe), do napięć nieprzekraczających 1000 V; złącza do włókien optycznych, wiązek włókien optycznych lub kabli światłowodowych',
    'Boards, panels, consoles, desks, cabinets and other bases, equipped with two or more apparatus of heading 8535 or 8536, for electric control or the distribution of electricity, including those incorporating instruments or apparatus of Chapter 90, and numerical control apparatus, other than switching apparatus of heading 8517' => 'Tablice, panele, konsole, pulpity, szafy i pozostałe układy wspornikowe, wyposażone przynajmniej w dwa lub więcej urządzeń objętych pozycją 8535 lub 8536, służące do elektrycznego sterowania lub rozdziału energii elektrycznej, włącznie z układami zawierającymi przyrządy lub aparaturę, objęte działem 90, oraz aparatura sterowana numerycznie, inna niż aparatura połączeniowa objęta pozycją 8517',
    'Parts suitable for use solely or principally with the apparatus of heading 8535, 8536 or 8537' => 'Części nadające się wyłącznie lub głównie do stosowania z urządzeniami objętymi pozycją 8535, 8536 lub 8537',
    'Electric filament or discharge lamps, including sealed beam lamp units and ultraviolet or infra-red lamps; arc-lamps; light-emitting diode (LED) light sources' => 'Elektryczne lampy żarowe lub wyładowcze, włączając zespoły nierozbieralnych wkładów reflektorów oraz promienniki lampowe nadfioletu lub podczerwieni; lampy łukowe; źródła światła z diod elektroluminescencyjnych (LED)',
    'Thermionic, cold cathode or photocathode valves and tubes (for example, vacuum or vapour or gas filled valves and tubes, mercury arc rectifying valves and tubes, cathode ray tubes, television camera tubes)' => 'Lampy elektronowe z termokatodą, o zimnej katodzie lub z fotokatodą (na przykład elektronowe lampy próżniowe, wyładowcze lub gazowane, rtęciowe lampy prostownicze, lampy elektronopromieniowe, telewizyjne lampy analizujące)',
    'Semiconductor devices (for example, diodes, transistors, semiconductor-based transducers); photosensitive semiconductor devices, including photovoltaic cells whether or not assembled in modules or made up into panels; light-emitting diodes (LED), whether or not assembled with other light-emitting diodes (LED); mounted piezo-electric crystals' => 'Urządzenia półprzewodnikowe (na przykład diody, tranzystory, przetworniki półprzewodnikowe); światłoczułe urządzenia półprzewodnikowe, włączając fotoogniwa, nawet zmontowane w moduły lub tworzące panele; diody elektroluminescencyjne (LED), nawet zmontowane z innymi diodami elektroluminescencyjnymi (LED); oprawione kryształy piezoelektryczne',
    'Electronic integrated circuits' => 'Elektroniczne układy scalone',
    'Electrical machines and apparatus, having individual functions, not specified or included elsewhere in this chapter' => 'Maszyny i aparatura, elektryczne, posiadające indywidualne funkcje, niewymienione ani niewłączone gdzie indziej w niniejszym dziale',
    'Insulated (including enamelled or anodised) wire, cable (including coaxial cable) and other insulated electric conductors, whether or not fitted with connectors; optical fibre cables, made up of individually sheathed fibres, whether or not assembled with electric conductors or fitted with connectors' => 'Drut izolowany (włączając emaliowany lub anodyzowany), kable (włączając kabel koncentryczny) oraz pozostałe izolowane przewody elektryczne, nawet wyposażone w złącza; przewody z włókien optycznych, złożone z indywidualnie osłoniętych włókien, nawet połączone z przewodnikami prądu elektrycznego lub wyposażone w złącza',
    'Carbon electrodes, carbon brushes, lamp carbons, battery carbons and other articles of graphite or other carbon, with or without metal, of a kind used for electrical purposes' => 'Elektrody węglowe, szczotki węglowe, węgle do lamp, węgiel do baterii oraz inne artykuły z grafitu lub innego rodzaju węgla, z metalem lub bez, w rodzaju stosowanych w elektrotechnice',
    'Electrical insulators of any material' => 'Izolatory elektryczne z dowolnego materiału',
    'Insulating fittings for electrical machines, appliances or equipment, being fittings wholly of insulating material apart from any minor components of metal (for example, threaded sockets) incorporated during moulding solely for purposes of assembly, other than insulators of heading 8546; electrical conduit tubing and joints therefor, of base metal lined with insulating material' => 'Osprzęt izolacyjny do maszyn, urządzeń lub sprzętu elektrycznego, będący całkowicie osprzętem z materiału izolacyjnego, poza drobnymi elementami z metalu (na przykład gniazda gwintowane), wprowadzanymi podczas formowania wyłącznie do celów montażowych, inne niż izolatory objęte pozycją 8546; elektryczne rurki kablowe oraz ich połączenia, z metali nieszlachetnych, wyłożone materiałem izolacyjnym',
    'Electrical parts of machinery or apparatus, not specified or included elsewhere in this chapter' => 'Elektryczne części maszyn lub urządzeń, niewymienione ani niewłączone gdzie indziej w niniejszym dziale',
    'Electrical and electronic waste and scrap' => 'Odpady i złom elektryczne i elektroniczne',
    'Rail locomotives powered from an external source of electricity or by electric accumulators' => 'Lokomotywy szynowe zasilane energią elektryczną ze źródła zewnętrznego lub z akumulatorów',
    'Other rail locomotives; locomotive tenders' => 'Pozostałe lokomotywy; tendry',
    'Self-propelled railway or tramway coaches, vans and trucks, other than those of heading 8604' => 'Wagony osobowe, towarowe lub transportowe, kolejowe lub tramwajowe, o napędzie własnym, inne niż te objęte pozycją 8604',
    'Railway or tramway goods vans and wagons, not self-propelled' => 'Wagony towarowe, kolejowe lub tramwajowe, bez własnego napędu',
    'Parts of railway or tramway locomotives or rolling stock' => 'Części lokomotyw szynowych lub taboru kolejowego',
    'Containers (including containers for the transport of fluids) specially designed and equipped for carriage by one or more modes of transport' => 'Pojemniki (włączając pojemniki do transportu cieczy) specjalnie skonstruowane i wyposażone do przewozu jednym lub więcej środkami transportu',
    'Tractors (other than tractors of heading 8709)' => 'Ciągniki (inne niż ciągniki objęte pozycją 8709)',
    'Motor vehicles for the transport of ten or more persons, including the driver' => 'Pojazdy silnikowe do przewozu dziesięciu lub więcej osób razem z kierowcą',
    'Motor cars and other motor vehicles principally designed for the transport of persons (other than those of heading 8702), including station wagons and racing cars' => 'Samochody i pozostałe pojazdy silnikowe przeznaczone zasadniczo do przewozu osób (inne niż te objęte pozycją 8702), włącznie z samochodami osobowo-towarowymi (kombi) oraz samochodami wyścigowymi',
    'Motor vehicles for the transport of goods' => 'Pojazdy silnikowe do transportu towarów',
    'Special purpose motor vehicles, other than those principally designed for the transport of persons or goods (for example, breakdown lorries, crane lorries, fire fighting vehicles, concrete-mixer lorries, road sweeper lorries, spraying lorries, mobile workshops, mobile radiological units)' => 'Pojazdy silnikowe specjalnego przeznaczenia, inne niż te zasadniczo przeznaczone do przewozu osób lub towarów (na przykład pojazdy pogotowia technicznego, dźwigi samochodowe, pojazdy strażackie, betoniarki samochodowe, zamiatarki, polewaczki, przewoźne warsztaty, ruchome stacje radiologiczne)',
    'Chassis fitted with engines, for the motor vehicles of headings 8701 to 8705' => 'Podwozia wyposażone w silniki, do pojazdów silnikowych objętych pozycjami od 8701 do 8705',
    'Bodies (including cabs), for the motor vehicles of headings 8701 to 8705' => 'Nadwozia (włączając kabiny), do pojazdów silnikowych objętych pozycjami od 8701 do 8705',
    'Parts and accessories of the motor vehicles of headings 8701 to 8705' => 'Części i akcesoria do pojazdów silnikowych objętych pozycjami od 8701 do 8705',
    'Works trucks, self-propelled, not fitted with lifting or handling equipment, of the type used in factories, warehouses, dock areas or airports for short distance transport of goods; tractors of the type used on railway station platforms; parts of the foregoing vehicles' => 'Pojazdy do transportu wewnątrzzakładowego, z własnym napędem, niewyposażone w urządzenia podnośnikowe, w rodzaju stosowanych w zakładach produkcyjnych, magazynach, portach lub lotniskach, do przewozu towarów na niewielkie odległości; ciągniki typu stosowanych na peronach kolejowych; części powyższych pojazdów',
    'Motorcycles (including mopeds) and cycles fitted with an auxiliary motor, with or without side-cars; side-cars' => 'Motocykle (włączając motorowery) oraz rowery wyposażone w pomocnicze silniki, z wózkiem bocznym lub bez; wózki boczne',
    'Bicycles and other cycles (including delivery tricycles), not motorised' => 'Rowery dwukołowe i pozostałe rowery (włączając trzykołowe wózki-rowery dostawcze), bezsilnikowe',
    'Carriages for disabled persons, whether or not motorised or otherwise mechanically propelled' => 'Wózki dla osób niepełnosprawnych, nawet z silnikiem lub napędzane mechanicznie w inny sposób',
    'Parts and accessories of vehicles of headings 8711 to 8713' => 'Części i akcesoria pojazdów objętych pozycjami od 8711 do 8713',
    'Baby carriages and parts thereof' => 'Wózki dziecięce i ich części',
    'Trailers and semi-trailers; other vehicles, not mechanically propelled; parts thereof' => 'Przyczepy i naczepy; pozostałe pojazdy bez napędu mechanicznego; ich części',
    'Balloons and dirigibles; gliders, hang gliders and other non-powered aircraft' => 'Balony i sterowce; szybowce, lotnie oraz pozostałe statki powietrzne, bez napędu',
    'Other aircraft (for example, helicopters, aeroplanes), except unmanned aircraft of heading 8806; spacecraft (including satellites) and suborbital and spacecraft launch vehicles' => 'Pozostałe statki powietrzne (na przykład śmigłowce, samoloty), z wyjątkiem bezzałogowych statków powietrznych objętych pozycją 8806; statki kosmiczne (włączając sztuczne satelity) oraz stacje orbitalne i pojazdy nośne statków kosmicznych',
    'Aircraft launching gear; deck-arrestor or similar gear; ground flying trainers; parts of the foregoing articles' => 'Maszyny i urządzenia startowe do statków powietrznych; maszyny i urządzenia umożliwiające lądowanie na lotniskowcu lub podobne maszyny i urządzenia; naziemne szkoleniowe symulatory lotu; części do powyższych maszyn i urządzeń',
    'Unmanned aircraft' => 'Bezzałogowe statki powietrzne',
    'Parts of goods of heading 8801, 8802 or 8806' => 'Części towarów objętych pozycją 8801, 8802 lub 8806',
    'Cruise ships, excursion boats, ferry-boats, cargo ships, barges and similar vessels for the transport of persons or goods' => 'Liniowce pasażerskie, łodzie wycieczkowe, promy, statki towarowe, barki oraz podobne jednostki pływające, do przewozu osób lub towarów',
    'Fishing vessels; factory ships and other vessels for processing or preserving fishery products' => 'Statki rybackie; statki przetwórnie oraz pozostałe jednostki pływające, do przetwarzania lub konserwowania produktów rybołówstwa',
    'Yachts and other vessels for pleasure or sports; rowing boats and canoes' => 'Jachty i pozostałe jednostki pływające, wypoczynkowe lub sportowe; łodzie wiosłowe i kajaki',
    'Tugs and pusher craft' => 'Holowniki i pchacze',
    'Light-vessels, fire-floats, dredgers, floating cranes, and other vessels the navigability of which is subsidiary to their main function; floating docks; floating or submersible drilling or production platforms' => 'Latarniowce, statki pożarnicze, pogłębiarki, dźwigi pływające i pozostałe jednostki pływające, których zdolność żeglugowa ma drugorzędne znaczenie wobec ich podstawowej funkcji; pływające doki; platformy wiertnicze lub produkcyjne, pływające lub podwodne',
    'Other vessels, including warships and lifeboats other than rowing boats' => 'Pozostałe jednostki pływające, włączając okręty wojenne i łodzie ratunkowe, inne niż łodzie wiosłowe',
    'Other floating structures (for example, rafts, tanks, coffer-dams, landing stages, buoys and beacons)' => 'Pozostałe konstrukcje pływające (na przykład tratwy, zbiorniki, koferdamy, przystanie, boje i znaki nawigacyjne)',
    'Optical fibres and optical fibre bundles; optical fibre cables other than those of heading 8544; sheets and plates of polarising material; lenses (including contact lenses), prisms, mirrors and other optical elements, of any material, unmounted, other than such elements of glass not optically worked' => 'Włókna optyczne oraz wiązki włókien optycznych; kable światłowodowe, inne niż te objęte pozycją 8544; arkusze i płyty z materiałów polaryzujących; soczewki (włączając soczewki kontaktowe), pryzmaty, zwierciadła i pozostałe elementy optyczne z dowolnego materiału, nieoprawione, inne niż elementy tego rodzaju ze szkła nieobrobionego optycznie',
    'Lenses, prisms, mirrors and other optical elements, of any material, mounted, being parts of or fittings for instruments or apparatus, other than such elements of glass not optically worked' => 'Soczewki, pryzmaty, zwierciadła i pozostałe elementy optyczne, z dowolnego materiału, oprawione, stanowiące część lub wyposażenie przyrządów lub aparatury, ale inne niż elementy tego rodzaju ze szkła nieobrobionego optycznie',
    'Frames and mountings for spectacles, goggles or the like, and parts thereof' => 'Oprawki do okularów, gogli lub tym podobnych oraz ich części',
    'Spectacles, goggles and the like, corrective, protective or other' => 'Okulary, gogle i tym podobne, korekcyjne, ochronne lub pozostałe',
    'Binoculars, monoculars, other optical telescopes, and mountings therefor; other astronomical instruments and mountings therefor, but not including instruments for radio-astronomy' => 'Lornetki, lunety, pozostałe teleskopy optyczne i ich mocowania; pozostałe przyrządy astronomiczne oraz ich mocowania, z wyłączeniem przyrządów radioastronomicznych',
    'Photographic (other than cinematographic) cameras; photographic flashlight apparatus and flashbulbs other than discharge lamps of heading 8539' => 'Aparaty fotograficzne (inne niż kinematograficzne); lampy błyskowe (flesze) oraz żarówki błyskowe, inne niż lampy wyładowcze objęte pozycją 8539',
    'Cinematographic cameras and projectors, whether or not incorporating sound recording or reproducing apparatus' => 'Kamery i projektory kinematograficzne, nawet zawierające aparaturę do zapisu i odtwarzania dźwięku',
    'Image projectors, other than cinematographic; photographic (other than cinematographic) enlargers and reducers' => 'Rzutniki obrazów, inne niż kinematograficzne; powiększalniki i pomniejszalniki fotograficzne (inne niż kinematograficzne)',
    'Apparatus and equipment for photographic (including cinematographic) laboratories, not specified or included elsewhere in this chapter; negatoscopes; projection screens' => 'Aparatura i wyposażenie do laboratoriów fotograficznych (włączając kinematograficzne), niewymienione ani niewłączone gdzie indziej w niniejszym dziale; negatywoskopy; ekrany projekcyjne',
    'Compound optical microscopes, including those for photomicrography, cinephotomicrography or microprojection' => 'Mikroskopy optyczne, włączając mikroskopy do mikrofotografii, mikrokinematografii lub mikroprojekcji',
    'Microscopes other than optical microscopes; diffraction apparatus' => 'Mikroskopy, inne niż mikroskopy optyczne; aparatura dyfrakcyjna',
    'Lasers, other than laser diodes; other optical appliances and instruments, not specified or included elsewhere in this chapter' => 'Lasery, inne niż diody laserowe; pozostałe urządzenia i przyrządy optyczne, niewymienione ani niewłączone gdzie indziej w niniejszym dziale',
    'Direction finding compasses; other navigational instruments and appliances' => 'Kompasy, busole; pozostałe przyrządy i urządzenia nawigacyjne',
    'Surveying (including photogrammetrical surveying), hydrographic, oceanographic, hydrological, meteorological or geophysical instruments and appliances, excluding compasses; rangefinders' => 'Przyrządy i urządzenia geodezyjne (włączając do pomiarów fotogrametrycznych), hydrograficzne, oceanograficzne, hydrologiczne, meteorologiczne lub geofizyczne, z wyłączeniem kompasów i busoli; dalmierze',
    'Balances of a sensitivity of 5 cg or better, with or without weights' => 'Wagi o czułości 5 cg lub lepszej, z odważnikami lub bez',
    'Drawing, marking-out or mathematical calculating instruments (for example, drafting machines, pantographs, protractors, drawing sets, slide rules, disc calculators); instruments for measuring length, for use in the hand (for example, measuring rods and tapes, micrometers, callipers), not specified or included elsewhere in this chapter' => 'Przyrządy kreślarskie, traserskie lub obliczeniowe (na przykład maszyny kreślące, pantografy, kątomierze, zestawy kreślarskie, suwaki logarytmiczne, tarcze rachunkowe); ręczne przyrządy do pomiaru długości (na przykład łaty miernicze i przymiary taśmowe, mikrometry, suwmiarki), niewymienione ani niewłączone gdzie indziej w niniejszym dziale',
    'Instruments and appliances used in medical, surgical, dental or veterinary sciences, including scintigraphic apparatus, other electromedical apparatus and sight-testing instruments' => 'Przyrządy i urządzenia stosowane w medycynie, chirurgii, stomatologii lub weterynarii, włączając aparaturę scyntygraficzną, inną aparaturę elektromedyczną oraz przyrządy do badania wzroku',
    'Mechano-therapy appliances; massage apparatus; psychological aptitude-testing apparatus; ozone therapy, oxygen therapy, aerosol therapy, artificial respiration or other therapeutic respiration apparatus' => 'Urządzenia do mechanoterapii; aparatura do masażu; aparatura do testów psychotechnicznych; aparatura do ozonoterapii, tlenoterapii, aerozoloterapii, sztucznego oddychania lub pozostałe respiratory terapeutyczne',
    'Other breathing appliances and gas masks, excluding protective masks having neither mechanical parts nor replaceable filters' => 'Pozostałe aparaty do oddychania oraz maski gazowe, z wyłączeniem masek ochronnych nieposiadających ani części mechanicznych ani wymiennych filtrów',
    'Orthopaedic appliances, including crutches, surgical belts and trusses; splints and other fracture appliances; artificial parts of the body; hearing aids and other appliances which are worn or carried, or implanted in the body, to compensate for a defect or disability' => 'Przyrządy ortopedyczne, włącznie z kulami, pasami chirurgicznymi i przepuklinowymi; szyny i pozostałe przyrządy stosowane przy złamaniach; protezy; aparaty słuchowe i inne przyrządy zakładane, noszone lub wszczepiane, mające na celu skorygowanie wady lub kalectwa',
    'Apparatus based on the use of X-rays or of alpha, beta, gamma or other ionising radiation, whether or not for medical, surgical, dental or veterinary uses, including radiography or radiotherapy apparatus, X-ray tubes and other X-ray generators, high tension generators, control panels and desks, screens, examination or treatment tables, chairs and the like' => 'Aparatura wykorzystująca promieniowanie rentgenowskie lub promieniowanie alfa, beta gamma lub inne promieniowanie jonizujące, nawet do zastosowań medycznych, chirurgicznych, stomatologicznych lub weterynaryjnych, włącznie z aparaturą do radiografii lub radioterapii, lampami rentgenowskimi oraz pozostałymi generatorami promieni rentgena, generatorami wysokiego napięcia, pulpitami i panelami sterowniczymi, ekranami, stołami, fotelami i temu podobnymi, do badań lub leczenia',
    'Instruments, apparatus and models, designed for demonstrational purposes (for example, in education or exhibitions), unsuitable for other uses' => 'Przyrządy, aparatura i modele, przeznaczone do celów pokazowych (na przykład do nauczania lub na wystawach), nienadające się do innych zastosowań',
    'Machines and appliances for testing the hardness, strength, compressibility, elasticity or other mechanical properties of materials (for example, metals, wood, textiles, paper, plastics)' => 'Maszyny oraz urządzenia do testowania twardości, wytrzymałości, ściśliwości, elastyczności lub podobnych mechanicznych własności materiałów (na przykład metali, drewna, materiałów włókienniczych, papieru lub tworzyw sztucznych)',
    'Hydrometers and similar floating instruments, thermometers, pyrometers, barometers, hygrometers and psychrometers, recording or not, and any combination of these instruments' => 'Hydrometry oraz podobne przyrządy pływające; termometry, pirometry, barometry, higrometry, psychrometry, zapisujące lub nie, oraz dowolna kombinacja tych przyrządów',
    'Instruments and apparatus for measuring or checking the flow, level, pressure or other variables of liquids or gases (for example, flow meters, level gauges, manometers, heat meters), excluding instruments and apparatus of heading 9014, 9015, 9028 or 9032' => 'Przyrządy i aparatura do pomiaru lub kontroli przepływu, poziomu, ciśnienia lub innych parametrów cieczy lub gazów (na przykład przepływomierze, poziomowskazy, manometry, ciśnieniomierze, liczniki energii cieplnej) z wyłączeniem przyrządów i aparatury, objętych pozycją 9014, 9015, 9028 lub 9032',
    'Instruments and apparatus for physical or chemical analysis (for example, polarimeters, refractometers, spectrometers, gas or smoke analysis apparatus); instruments and apparatus for measuring or checking viscosity, porosity, expansion, surface tension or the like; instruments and apparatus for measuring or checking quantities of heat, sound or light (including exposure meters); microtomes' => 'Przyrządy i aparatura do analizy fizycznej lub chemicznej (na przykład polarymetry, refraktometry, spektrometry, aparatura do analizy gazu lub dymu); przyrządy i aparatura do pomiaru lub kontroli lepkości, porowatości, rozszerzalności, napięcia powierzchniowego lub tym podobne; przyrządy i aparatura do mierzenia lub kontroli ilości ciepła, światła lub dźwięku (włącznie ze światłomierzami); mikrotomy',
    'Gas, liquid or electricity supply or production meters, including calibrating meters therefor' => 'Gazomierze, liczniki do cieczy lub energii elektrycznej, do pomiaru zużycia lub produkcji, włącznie z licznikami wzorcowymi do nich',
    'Revolution counters, production counters, taximeters, milometers, pedometers and the like; speed indicators and tachometers, other than those of heading 9014 or 9015; stroboscopes' => 'Obrotomierze, liczniki produkcji, taksometry, drogomierze (liczniki kilometrów), krokomierze i tym podobne; szybkościomierze i tachometry, inne niż te objęte pozycją 9014 lub 9015; stroboskopy',
    'Oscilloscopes, spectrum analysers and other instruments and apparatus for measuring or checking electrical quantities, excluding meters of heading 9028; instruments and apparatus for measuring or detecting alpha, beta, gamma, X-ray, cosmic or other ionising radiation' => 'Oscyloskopy, analizatory widma oraz inne przyrządy i aparatura do pomiaru lub kontroli wielkości elektrycznych, z wyłączeniem mierników objętych pozycją 9028; przyrządy i aparatura do pomiaru lub wykrywania promieniowania alfa, beta, gamma, rentgena, promieni kosmicznych lub innych promieni jonizujących',
